INSERT INTO public.mix_taxonomy VALUES (7, 'Deposits', 3, 'DepositProductsDimension:CompulsoryMember', 1, 'The value of deposits that an MFI''s clients are required to  maintain as a condition of an existing or future loan.', NULL);
INSERT INTO public.mix_taxonomy VALUES (8, 'Deposits', 3, 'DepositProductsDimension:VoluntaryMember', 1, 'The value of deposits that an MFI''s clients are not required to  maintain as a condition of an existing or future loan.', NULL);
INSERT INTO public.mix_taxonomy VALUES (9, 'Deposits', 3, 'LocationDimension:RuralMember', 1, 'Located in rural areas. Segmentation based on location.', NULL);
INSERT INTO public.mix_taxonomy VALUES (10, 'Deposits', 3, 'LocationDimension:UrbanMember', 1, 'Located in urban areas. Segmentation based on location.', NULL);
