INSERT INTO public.stretchy_parameter VALUES (1002, 'FullParameterList', NULL, 'n/a', 'n/a', 'n/a', 'n/a', 'Y', NULL, NULL, 'select sp.parameter_name, sp.parameter_variable, sp.parameter_label, sp."parameter_displayType", sp."parameter_FormatType", sp.parameter_default, sp."selectOne",  sp."selectAll", spp.parameter_name as parentParameterName from stretchy_parameter sp  left join stretchy_parameter spp on spp.id = sp.parent_id  where sp.special is null  and exists     (select ''f''    from stretchy_report sr    join stretchy_report_parameter srp on srp.report_id = sr.id   and sr.self_service_user_report = ${isSelfServiceUser}    where sr.report_name in(${reportListing})    and srp.parameter_id = sp.id   ) order by sp.id', NULL);
INSERT INTO public.stretchy_parameter VALUES (1003, 'reportCategoryList', NULL, 'n/a', 'n/a', 'n/a', 'n/a', 'Y', NULL, NULL, 'select  r.id as report_id, r.report_name, r.report_type, r.report_subtype, r.report_category,
  rp.id as parameter_id, rp.report_parameter_name, p.parameter_name
  from stretchy_report r
  left join stretchy_report_parameter rp on rp.report_id = r.id
  left join stretchy_parameter p on p.id = rp.parameter_id
  where r.report_category = ''${reportCategory}''
  and r.use_report is true and r.self_service_user_report = ${isSelfServiceUser}  
  and exists
  (select ''f''
  from m_appuser_role ur 
  join m_role rr on rr.id = ur.role_id
  join m_role_permission rp on rp.role_id = rr.id
  join m_permission p on p.id = rp.permission_id
  where ur.appuser_id = ${currentUserId}
  and (p.code in (''ALL_FUNCTIONS_READ'', ''ALL_FUNCTIONS'') or p.code = concat(''READ'', r.report_name)) )
  order by r.report_category, r.report_name, rp.id', NULL);
INSERT INTO public.stretchy_parameter VALUES (1001, 'FullReportList', NULL, 'n/a', 'n/a', 'n/a', 'n/a', 'Y', NULL, NULL, 'select  r.id as report_id, r.report_name, r.report_type, r.report_subtype, r.report_category,
rp.id as parameter_id, rp.report_parameter_name, p.parameter_name
  from stretchy_report r
  left join stretchy_report_parameter rp on rp.report_id = r.id 
  left join stretchy_parameter p on p.id = rp.parameter_id
  where r.use_report is true and r.self_service_user_report = ${isSelfServiceUser}
  and exists
  ( select ''f''
  from m_appuser_role ur 
  join m_role rr on rr.id = ur.role_id
  join m_role_permission rp on rp.role_id = rr.id
  join m_permission p on p.id = rp.permission_id
  where ur.appuser_id = ${currentUserId}
  and (p.code in (''ALL_FUNCTIONS_READ'', ''ALL_FUNCTIONS'') or p.code = concat(''READ'', r.report_name)) )
  order by r.report_category, r.report_name, rp.id', NULL);


