INSERT INTO public.stretchy_report VALUES (1, 'Client Listing', 'Table', NULL, 'Client', 'SELECT Concat(REPEAT(''..'', (( Length(ounder.hierarchy) - Length( REPLACE(ounder.hierarchy, ''.'', '''')) - 1 ))) , ounder.name)  AS "Office/Branch", c.account_no  AS "Client Account No.", c.display_name  AS name, r.enum_message_property AS "Status", c.activation_date AS "Activation", c.external_id AS "External Id" FROM   m_office o JOIN m_office ounder ON ounder.hierarchy LIKE Concat(o.hierarchy, ''%'') AND ounder.hierarchy LIKE Concat(''${currentUserHierarchy}'', ''%'') JOIN m_client c ON c.office_id = ounder.id LEFT JOIN r_enum_value r ON r.enum_name = ''status_enum'' AND r.enum_id = c.status_enum WHERE  o.id = ''${officeId}'' ORDER  BY ounder.hierarchy, c.account_no', 'Individual Client Report    Lists the small number of defined fields on the client table.  Would expect to copy this   report and add any ''one to one'' additional data for specific tenant needs.    Can be run for any size MFI but you''d expect it only to be run within a branch for   larger ones.  Depending on how many columns are displayed, there is probably is a limit of about 20/50k clients returned for html display (export to excel doesn''t   have that client browser/memory impact).', true, true, false);
INSERT INTO public.stretchy_report VALUES (2, 'Client Loans Listing', 'Table', NULL, 'Client', 'SELECT    Concat(REPEAT(''..'', ((Length(ounder.hierarchy) - Length(REPLACE(ounder.hierarchy, ''.'', '''')) - 1))), ounder.name) AS "Office/Branch", c.account_no AS "Client Account No.", c.display_name AS name, r.enum_message_property  AS "Client Status", lo.display_name  AS "Loan Officer", l.account_no AS "Loan Account No.", l.external_id  AS "External Id", p.name AS loan, st.enum_message_property AS "Status", f.name AS fund, purp.code_value  AS "Loan Purpose", Coalesce(cur.display_symbol, l.currency_code)  AS currency, l.principal_amount, l.arrearstolerance_amount AS "Arrears Tolerance Amount", l.number_of_repayments  AS "Expected No. Repayments", l.annual_nominal_interest_rate  AS "Annual Nominal Interest Rate", l.nominal_interest_rate_per_period  AS "Nominal Interest Rate Per Period", ipf.enum_message_property AS "Interest Rate Frequency", im.enum_message_property  AS "Interest Method", icp.enum_message_property AS "Interest Calculated in Period", l.term_frequency  AS "Term Frequency", tf.enum_message_property  AS "Term Frequency Period", l.repay_every AS "Repayment Frequency", rf.enum_message_property  AS "Repayment Frequency Period", am.enum_message_property  AS "Amortization", l.total_charges_due_at_disbursement_derived AS "Total Charges Due At Disbursement", DATE_TRUNC(''day'', l.submittedon_date) AS submitted, DATE_TRUNC(''day'', l.approvedon_date)                   approved, l.expected_disbursedon_date AS "Expected Disbursal", DATE_TRUNC(''day'', l.expected_firstrepaymenton_date) AS "Expected First Repayment", DATE_TRUNC(''day'', l.interest_calculated_from_date)  AS "Interest Calculated From" , DATE_TRUNC(''day'', l.disbursedon_date) AS disbursed, DATE_TRUNC(''day'', l.expected_maturedon_date)  AS "Expected Maturity", DATE_TRUNC(''day'', l.maturedon_date) AS "Matured On", DATE_TRUNC(''day'', l.closedon_date)  AS closed, DATE_TRUNC(''day'', l.rejectedon_date)  AS rejected, DATE_TRUNC(''day'', l.rescheduledon_date) AS rescheduled, DATE_TRUNC(''day'', l.withdrawnon_date) AS withdrawn, DATE_TRUNC(''day'', l.writtenoffon_date)  AS "Written Off" FROM      m_office o JOIN      m_office ounder ON        ounder.hierarchy LIKE concat(o.hierarchy, ''%'') AND       ounder.hierarchy LIKE concat(''${currentUserHierarchy}'', ''%'') JOIN      m_client c ON        c.office_id = ounder.id LEFT JOIN r_enum_value r ON        r.enum_name = ''status_enum'' AND       r.enum_id = c.status_enum LEFT JOIN m_loan l ON        l.client_id = c.id LEFT JOIN m_staff lo ON        lo.id = l.loan_officer_id LEFT JOIN m_product_loan p ON        p.id = l.product_id LEFT JOIN m_fund f ON        f.id = l.fund_id LEFT JOIN r_enum_value st ON        st.enum_name = ''loan_status_id'' AND       st.enum_id = l.loan_status_id LEFT JOIN r_enum_value ipf ON        ipf.enum_name = ''interest_period_frequency_enum'' AND       ipf.enum_id = l.interest_period_frequency_enum LEFT JOIN r_enum_value im ON        im.enum_name = ''interest_method_enum'' AND       im.enum_id = l.interest_method_enum LEFT JOIN r_enum_value tf ON        tf.enum_name = ''term_period_frequency_enum'' AND       tf.enum_id = l.term_period_frequency_enum LEFT JOIN r_enum_value icp ON        icp.enum_name = ''interest_calculated_in_period_enum'' AND       icp.enum_id = l.interest_calculated_in_period_enum LEFT JOIN r_enum_value rf ON        rf.enum_name = ''repayment_period_frequency_enum'' AND       rf.enum_id = l.repayment_period_frequency_enum LEFT JOIN r_enum_value am ON        am.enum_name = ''amortization_method_enum'' AND       am.enum_id = l.amortization_method_enum LEFT JOIN m_code_value purp ON        purp.id = l.loanpurpose_cv_id LEFT JOIN m_currency cur ON        cur.code = l.currency_code WHERE     o.id = ''${officeId}'' AND       ( l.currency_code = ''${currencyId}'' OR        ''-1'' = ''${currencyId}'') AND       ( l.product_id = ''${loanProductId}'' OR        ''-1'' = ''${loanProductId}'') AND       ( coalesce(l.loan_officer_id, -10) = ${loanOfficerId} OR        ''-1'' = ${loanOfficerId}) AND       ( coalesce(l.fund_id, -10) = ${fundId} OR        -1 = ${fundId}) AND       ( coalesce(l.loanpurpose_cv_id, -10) = ${loanPurposeId} OR        -1 = ${loanPurposeId}) ORDER BY  ounder.hierarchy, 2 , l.id', 'Individual Client Report    Pretty   wide report that lists the basic details of client loans.      Can be run for any size MFI but you''d expect it only to be run within a branch for larger ones.    There is probably is a limit of about 20/50k clients returned for html display (export to excel doesn''t have that client browser/memory impact).', true, true, false);
INSERT INTO public.stretchy_report VALUES (5, 'Loans Awaiting Disbursal', 'Table', NULL, 'Loan', 'SELECT    Concat(REPEAT(''..'', ((Length(ounder.hierarchy) - Length(REPLACE(ounder.hierarchy, ''.'', '''')) - 1))), ounder.name) AS "Office/Branch", c.account_no AS "Client Account No", c.display_name AS name, l.account_no AS "Loan Account No.", pl.name  AS "Product", f.name AS fund, Coalesce(cur.display_symbol, l.currency_code)  AS currency, l.principal_amount AS principal, l.term_frequency AS "Term Frequency", tf.enum_message_property AS "Term Frequency Period", l.annual_nominal_interest_rate AS "Annual Nominal Interest Rate", DATE_TRUNC(''day'', l.approvedon_date) AS "Approved", extract(day FROM (l.expected_disbursedon_date::TIMESTAMP - CURRENT_DATE)) AS "Days to Disbursal", DATE_TRUNC(''day'', l.expected_disbursedon_date) AS "Expected Disbursal", purp.code_value AS "Loan Purpose", lo.display_name AS "Loan Officer" FROM      m_office o JOIN      m_office ounder ON        ounder.hierarchy LIKE concat(o.hierarchy, ''%'') AND       ounder.hierarchy LIKE concat(''${currentUserHierarchy}'', ''%'') JOIN      m_client c ON        c.office_id = ounder.id JOIN      m_loan l ON        l.client_id = c.id JOIN      m_product_loan pl ON        pl.id = l.product_id LEFT JOIN m_staff lo ON        lo.id = l.loan_officer_id LEFT JOIN m_currency cur ON        cur.code = l.currency_code LEFT JOIN m_fund f ON        f.id = l.fund_id LEFT JOIN m_code_value purp ON        purp.id = l.loanpurpose_cv_id LEFT JOIN r_enum_value tf ON        tf.enum_name = ''term_period_frequency_enum'' AND       tf.enum_id = l.term_period_frequency_enum WHERE     o.id = ''${officeId}'' AND       ( l.currency_code = ''${currencyId}'' OR        ''-1'' = ''${currencyId}'') AND       ( l.product_id = ''${loanProductId}'' OR        ''-1'' = ''${loanProductId}'') AND       ( coalesce(l.loan_officer_id, -10) = ''${loanOfficerId}'' OR        ''-1'' = ''${loanOfficerId}'') AND       ( coalesce(l.fund_id, -10) = ''${fundId}'' OR        -1 = ''${fundId}'') AND       ( coalesce(l.loanpurpose_cv_id, -10) = ''${loanPurposeId}'' OR        -1 = ''${loanPurposeId}'') AND       l.loan_status_id = 200 ORDER BY  ounder.hierarchy, extract(day FROM (l.expected_disbursedon_date::TIMESTAMP - CURRENT_DATE)), c.account_no', 'Individual Client Report', true, true, false);
INSERT INTO public.stretchy_report VALUES (6, 'Loans Awaiting Disbursal Summary', 'Table', NULL, 'Loan', 'SELECT    Concat(REPEAT(''..'', ((Length(ounder.hierarchy) - Length(REPLACE(ounder.hierarchy, ''.'', '''')) - 1))), ounder.name) AS "Office/Branch", pl.name  AS "Product", Coalesce(cur.display_symbol, l.currency_code)  AS currency, f.name AS fund, Sum(l.principal_amount)  AS principal FROM      m_office o JOIN      m_office ounder ON        ounder.hierarchy LIKE Concat(o.hierarchy, ''%'') AND       ounder.hierarchy LIKE Concat(''${currentUserHierarchy}'', ''%'') JOIN      m_client c ON        c.office_id = ounder.id JOIN      m_loan l ON        l.client_id = c.id JOIN      m_product_loan pl ON        pl.id = l.product_id LEFT JOIN m_staff lo ON        lo.id = l.loan_officer_id LEFT JOIN m_currency cur ON        cur.code = l.currency_code LEFT JOIN m_fund f ON        f.id = l.fund_id LEFT JOIN m_code_value purp ON        purp.id = l.loanpurpose_cv_id WHERE     o.id = ''${officeId}'' AND       ( l.currency_code = ''${currencyId}'' OR        ''-1'' = ''${currencyId}'') AND       ( l.product_id = ''${loanProductId}'' OR        ''-1'' = ''${loanProductId}'') AND       ( coalesce(l.loan_officer_id, -10) = ''${loanOfficerId}'' OR        ''-1'' = ''${loanOfficerId}'') AND       ( coalesce(l.fund_id, -10) = ''${fundId}'' OR        -1 = ''${fundId}'') AND       ( coalesce(l.loanpurpose_cv_id, -10) = ''${loanPurposeId}'' OR        -1 = ''${loanPurposeId}'') AND       l.loan_status_id = 200 GROUP BY  ounder.hierarchy, pl.name, l.currency_code, f.name, ounder.name, cur.display_symbol ORDER BY  ounder.hierarchy, pl.name, l.currency_code, f.name', 'Individual Client Report', true, true, false);
INSERT INTO public.stretchy_report VALUES (7, 'Loans Awaiting Disbursal Summary by Month', 'Table', NULL, 'Loan', 'SELECT    Concat(REPEAT(''..'', ((Length(ounder.hierarchy) - Length(REPLACE(ounder.hierarchy, ''.'', '''')) - 1))), ounder.name) AS "Office/Branch", pl.name  AS "Product", Coalesce(cur.display_symbol, l.currency_code)  AS "currency", extract(year from l.expected_disbursedon_date) AS "Year", to_char(l.expected_disbursedon_date, ''Month'')  AS "Month", Sum(l.principal_amount)  AS "principal" FROM      m_office o JOIN      m_office ounder ON        ounder.hierarchy LIKE Concat(o.hierarchy, ''%'') AND       ounder.hierarchy LIKE Concat(''${currentUserHierarchy}'', ''%'') JOIN      m_client c ON        c.office_id = ounder.id JOIN      m_loan l ON        l.client_id = c.id JOIN      m_product_loan pl ON        pl.id = l.product_id LEFT JOIN m_staff lo ON        lo.id = l.loan_officer_id LEFT JOIN m_currency cur ON        cur.code = l.currency_code LEFT JOIN m_fund f ON        f.id = l.fund_id LEFT JOIN m_code_value purp ON        purp.id = l.loanpurpose_cv_id WHERE     o.id = ''${officeId}'' AND       ( l.currency_code = ''${currencyId}'' OR        ''-1'' = ''${currencyId}'') AND       ( l.product_id = ''${loanProductId}'' OR        ''-1'' = ''${loanProductId}'') AND       ( Coalesce(l.loan_officer_id, -10) = ''${loanOfficerId}'' OR        ''-1'' = ''${loanOfficerId}'') AND       ( coalesce(l.fund_id, -10) = ''${fundId}'' OR        -1 = ''${fundId}'') AND       ( coalesce(l.loanpurpose_cv_id, -10) = ''${loanPurposeId}'' OR        -1 = ''${loanPurposeId}'') AND       l.loan_status_id = 200 GROUP BY  ounder.hierarchy, ounder.name, cur.display_symbol, pl.name, l.currency_code, l.expected_disbursedon_date ORDER BY  ounder.hierarchy, pl.name, l.currency_code, extract(year from l.expected_disbursedon_date), to_char(l.expected_disbursedon_date, ''Month'')', 'Individual Client Report', true, true, false);
INSERT INTO public.stretchy_report VALUES (8, 'Loans Pending Approval', 'Table', NULL, 'Loan', 'SELECT    Concat(REPEAT(''..'', ((Length(ounder.hierarchy) - Length(REPLACE(ounder.hierarchy, ''.'', '''')) - 1))), ounder.name) AS "Office/Branch", c.account_no AS "Client Account No.", c.display_name AS "Client Name", Coalesce(cur.display_symbol, l.currency_code)  AS currency, pl.name  AS "Product", l.account_no AS "Loan Account No.", l.principal_amount AS "Loan Amount", l.term_frequency AS "Term Frequency", tf.enum_message_property AS "Term Frequency Period", l.annual_nominal_interest_rate AS " Annual Nominal Interest Rate", Extract(day FROM (CURRENT_DATE - l.submittedon_date::TIMESTAMP)) AS "Days Pending Approval", purp.code_value AS "Loan Purpose", lo.display_name AS "Loan Officer" FROM      m_office o JOIN      m_office ounder ON        ounder.hierarchy LIKE concat(o.hierarchy, ''%'') AND       ounder.hierarchy LIKE concat(''${currentUserHierarchy}'', ''%'') JOIN      m_client c ON        c.office_id = ounder.id JOIN      m_loan l ON        l.client_id = c.id JOIN      m_product_loan pl ON        pl.id = l.product_id LEFT JOIN m_staff lo ON        lo.id = l.loan_officer_id LEFT JOIN m_currency cur ON        cur.code = l.currency_code LEFT JOIN m_code_value purp ON        purp.id = l.loanpurpose_cv_id LEFT JOIN r_enum_value tf ON        tf.enum_name = ''term_period_frequency_enum'' AND       tf.enum_id = l.term_period_frequency_enum WHERE     o.id = ''${officeId}'' AND       ( l.currency_code = ''${currencyId}'' OR        ''-1'' = ''${currencyId}'') AND       ( l.product_id = ''${loanProductId}'' OR        ''-1'' = ''${loanProductId}'') AND       ( coalesce(l.loan_officer_id, -10) = ''${loanOfficerId}'' OR        ''-1'' = ''${loanOfficerId}'') AND       ( coalesce(l.loanpurpose_cv_id, -10) = ''${loanPurposeId}'' OR        -1 = ''${loanPurposeId}'') AND       l.loan_status_id = 100 ORDER BY  ounder.hierarchy, l.submittedon_date, l.account_no', 'Individual Client Report', true, true, false);
INSERT INTO public.stretchy_report VALUES (11, 'Active Loans - Summary', 'Table', NULL, 'Loan', 'SELECT   Concat(REPEAT(''..'', ((Length(mo.hierarchy) - Length(REPLACE(mo.hierarchy, ''.'', '''')) - 1))), mo.name) AS "Office/Branch", x.currency AS currency, x.client_count AS "No. of Clients", x.active_loan_count  AS "No. Active                    Loans", x. loans_in_arrears_count  AS "No. of Loans in                    Arrears", x.principal  AS "Total Loans Disbursed", x.principal_repaid AS "Principal Repaid", x.principal_outstanding  AS "Principal Outstanding", x.principal_overdue  AS "Principal Overdue", x.interest AS "Total Interest", x.interest_repaid  AS "Interest Repaid", x.interest_outstanding AS "Interest Outstanding", x.interest_overdue AS "Interest Overdue", x.fees AS "Total Fees", x.fees_repaid  AS "Fees Repaid", x.fees_outstanding AS "Fees Outstanding", x.fees_overdue AS "Fees Overdue", x.penalties  AS "Total Penalties", x.penalties_repaid AS "Penalties Repaid", x.penalties_outstanding  AS "Penalties Outstanding", x.penalties_overdue  AS "Penalties Overdue", ( CASE WHEN ${parType} = 1 THEN cast(round((x.principal_overdue * 100) / x.principal_outstanding, 2) AS                                                                                                                                     CHAR) WHEN ${parType} = 2 THEN cast(round(((x.principal_overdue + x.interest_overdue) * 100) / (x.principal_outstanding + x.interest_outstanding), 2) AS                                                                                   CHAR) WHEN ${parType} = 3 THEN cast(round(((x.principal_overdue + x.interest_overdue + x.fees_overdue) * 100) / (x.principal_outstanding + x.interest_outstanding + x.fees_outstanding), 2) AS                                             CHAR) WHEN ${parType} = 4 THEN cast(round(((x.principal_overdue + x.interest_overdue + x.fees_overdue + x.penalties_overdue) * 100) / (x.principal_outstanding + x.interest_outstanding + x.fees_outstanding + x.penalties_overdue), 2) AS CHAR) ELSE ''invalid PAR Type'' end) AS "Portfolio at Risk %" FROM     m_office mo JOIN ( SELECT    ounder.id AS branch, coalesce(cur.display_symbol, l.currency_code) AS currency, count(DISTINCT(c.id)) AS client_count, count(DISTINCT(l.id)) AS active_loan_count, count(DISTINCT(coalesce(laa.loan_id, l.id, NULL) )) AS loans_in_arrears_count, sum(l.principal_disbursed_derived)  AS principal, sum(l.principal_repaid_derived) AS principal_repaid, sum(l.principal_outstanding_derived)  AS principal_outstanding, sum(laa.principal_overdue_derived)  AS principal_overdue, sum(l.interest_charged_derived) AS interest, sum(l.interest_repaid_derived)  AS interest_repaid, sum(l.interest_outstanding_derived) AS interest_outstanding, sum(laa.interest_overdue_derived) AS interest_overdue, sum(l.fee_charges_charged_derived)  AS fees, sum(l.fee_charges_repaid_derived) AS fees_repaid, sum(l.fee_charges_outstanding_derived)  AS fees_outstanding, sum(laa.fee_charges_overdue_derived)  AS fees_overdue, sum(l.penalty_charges_charged_derived)  AS penalties, sum(l.penalty_charges_repaid_derived) AS penalties_repaid, sum(l.penalty_charges_outstanding_derived)  AS penalties_outstanding, sum(laa.penalty_charges_overdue_derived)  AS penalties_overdue FROM      m_office o JOIN      m_office ounder ON        ounder.hierarchy LIKE concat(o.hierarchy, ''%'') AND       ounder.hierarchy LIKE concat(''${currentUserHierarchy}'', ''%'') JOIN      m_client c ON        c.office_id = ounder.id JOIN      m_loan l ON        l.client_id = c.id LEFT JOIN m_loan_arrears_aging laa ON        laa.loan_id = l.id LEFT JOIN m_currency cur ON        cur.code = l.currency_code WHERE     o.id = ''${officeId}'' AND       ( l.currency_code = ''${currencyId}'' OR        ''-1'' = ''${currencyId}'') AND       ( l.product_id = ''${loanProductId}'' OR        ''-1'' = ''${loanProductId}'') AND       ( coalesce(l.loan_officer_id, -10) = ${loanOfficerId} OR        ''-1'' = ${loanOfficerId}) AND       ( coalesce(l.fund_id, -10) = ${fundId} OR        -1 = ${fundId}) AND       ( coalesce(l.loanpurpose_cv_id, -10) = ${loanPurposeId} OR        -1 = ${loanPurposeId}) AND       l.loan_status_id = 300 GROUP BY  ounder.id, l.currency_code, cur.display_symbol) x ON       x.branch = mo.id ORDER BY mo.hierarchy, x.currency', NULL, true, true, false);
INSERT INTO public.stretchy_report VALUES (12, 'Active Loans - Details', 'Table', NULL, 'Loan', 'SELECT    Concat(REPEAT(''..'', ((Length(ounder.hierarchy) - Length(REPLACE(ounder.hierarchy, ''.'', '''')) - 1))), ounder.name) AS "Office/Branch", Coalesce(cur.display_symbol, l.currency_code)  AS currency, lo.display_name  AS "Loan Officer", c.display_name AS "Client", l.account_no AS "Loan Account No.", pl.name  AS "Product", f.name AS fund, l.principal_amount AS "Loan Amount", l.annual_nominal_interest_rate AS "Annual Nominal Interest Rate", DATE_TRUNC(''day'', l.disbursedon_date)  AS "Disbursed Date", DATE_TRUNC(''day'', l.expected_maturedon_date) AS "Expected Matured On", l.principal_repaid_derived AS "Principal Repaid", l.principal_outstanding_derived  AS "Principal Outstanding", laa.principal_overdue_derived  AS "Principal Overdue", l.interest_repaid_derived  AS "Interest Repaid", l.interest_outstanding_derived AS "Interest Outstanding", laa.interest_overdue_derived AS "Interest Overdue", l.fee_charges_repaid_derived AS "Fees Repaid", l.fee_charges_outstanding_derived  AS "Fees Outstanding", laa.fee_charges_overdue_derived  AS "Fees Overdue", l.penalty_charges_repaid_derived AS "Penalties Repaid", l.penalty_charges_outstanding_derived  AS "Penalties Outstanding", penalty_charges_overdue_derived  AS "Penalties Overdue" FROM      m_office o JOIN      m_office ounder ON        ounder.hierarchy LIKE Concat(o.hierarchy, ''%'') AND       ounder.hierarchy LIKE Concat(''${currentUserHierarchy}'', ''%'') JOIN      m_client c ON        c.office_id = ounder.id JOIN      m_loan l ON        l.client_id = c.id JOIN      m_product_loan pl ON        pl.id = l.product_id LEFT JOIN m_staff lo ON        lo.id = l.loan_officer_id LEFT JOIN m_currency cur ON        cur.code = l.currency_code LEFT JOIN m_fund f ON        f.id = l.fund_id LEFT JOIN m_loan_arrears_aging laa ON        laa.loan_id = l.id WHERE     o.id = ''${officeId}'' AND       ( l.currency_code = ''${currencyId}'' OR        ''-1'' = ''${currencyId}'') AND       ( l.product_id = ''${loanProductId}'' OR        ''-1'' = ''${loanProductId}'') AND       ( Coalesce(l.loan_officer_id, -10) = ${loanOfficerId} OR        ''-1'' = ${loanOfficerId}) AND       ( coalesce(l.fund_id, -10) = ${fundId} OR        -1 = ${fundId}) AND       ( coalesce(l.loanpurpose_cv_id, -10) = ${loanPurposeId} OR        -1 = ${loanPurposeId}) AND       l.loan_status_id = 300 GROUP BY  l.id, ounder.hierarchy , ounder.name, cur.display_symbol, lo.display_name, c.display_name, pl.name, f.name, laa.principal_overdue_derived, laa.interest_overdue_derived, laa.fee_charges_overdue_derived, laa.penalty_charges_overdue_derived , c.account_no ORDER BY  ounder.hierarchy, l.currency_code, c.account_no, l.account_no', 'Individual Client   Report', true, true, false);
INSERT INTO public.stretchy_report VALUES (13, 'Obligation Met Loans Details', 'Table', NULL, 'Loan', 'SELECT    Concat(REPEAT(''..'', ((Length(ounder.hierarchy ) - Length(REPLACE(ounder.hierarchy, ''.'', '''')) - 1))), ounder.name) AS "Office/Branch", Coalesce(cur.display_symbol, l.currency_code) AS currency, c.account_no  AS "Client Account No.", c.display_name  AS "Client", l.account_no  AS "Loan Account No.", pl.name AS "Product", f.name  AS fund, l.principal_amount  AS "Loan Amount", l.total_repayment_derived AS "Total Repaid", l.annual_nominal_interest_rate  AS "Annual Nominal Interest Rate", DATE_TRUNC(''day'', l.disbursedon_date) AS "Disbursed", DATE_TRUNC(''day'', l.closedon_date)  AS "Closed", l.principal_repaid_derived  AS "Principal Repaid", l.interest_repaid_derived AS "Interest Repaid", l.fee_charges_repaid_derived  AS "Fees Repaid", l.penalty_charges_repaid_derived  AS "Penalties Repaid", lo.display_name AS "Loan Officer" FROM      m_office o JOIN      m_office ounder ON        ounder.hierarchy LIKE Concat(o.hierarchy, ''%'') AND       ounder.hierarchy LIKE Concat(''${currentUserHierarchy}'', ''%'') JOIN      m_client c ON        c.office_id = ounder.id JOIN      m_loan l ON        l.client_id = c.id JOIN      m_product_loan pl ON        pl.id = l.product_id LEFT JOIN m_staff lo ON        lo.id = l.loan_officer_id LEFT JOIN m_currency cur ON        cur.code = l.currency_code LEFT JOIN m_fund f ON        f.id = l.fund_id WHERE     o.id = ''${officeId}'' AND       ( l.currency_code = ''${currencyId}'' OR        ''-1'' = ''${currencyId}'') AND       ( l.product_id = ''${loanProductId}'' OR        ''-1'' = ''${loanProductId}'') AND       ( Coalesce(l.loan_officer_id, -10) = ${loanOfficerId} OR        ''-1'' = ${loanOfficerId}) AND       ( coalesce(l.fund_id, -10) = ${fundId} OR        -1 = ${fundId}) AND       ( coalesce(l.loanpurpose_cv_id, -10) = ${loanPurposeId} OR        -1 = ${loanPurposeId}) AND       ( CASE WHEN ${obligDateType} = 1 THEN l.closedon_date BETWEEN ''${startDate}'' AND ''${endDate}'' WHEN ${obligDateType} = 2 THEN l.disbursedon_date BETWEEN ''${startDate}'' AND ''${endDate}'' ELSE 1 = 1 end) AND       l.loan_status_id = 600 GROUP BY  l.id, ounder.hierarchy, ounder.name, cur.display_symbol, c.account_no, c.display_name, pl.name, f.name, lo.display_name ORDER BY  ounder.hierarchy, l.currency_code, c.account_no, l.account_no', 'Individual Client   Report', true, true, false);
INSERT INTO public.stretchy_report VALUES (14, 'Obligation Met Loans Summary', 'Table', NULL, 'Loan', 'SELECT    Concat(REPEAT(''..'', ((Length(ounder.hierarchy ) - Length(REPLACE(ounder.hierarchy, ''.'', '''')) - 1))), ounder.name) AS "Office/Branch", Coalesce(cur.display_symbol, l.currency_code) AS currency, Count(DISTINCT(c.id)) AS "No. of Clients", Count(DISTINCT(l.id)) AS "No. of Loans", Sum(l.principal_amount) AS "Total Loan Amount", Sum(l.principal_repaid_derived) AS "Total Principal Repaid", Sum(l.interest_repaid_derived)  AS "Total Interest Repaid", Sum(l.fee_charges_repaid_derived) AS "Total Fees Repaid", Sum(l.penalty_charges_repaid_derived) AS "Total Penalties Repaid", Sum(l.interest_waived_derived)  AS "Total Interest Waived", Sum(l.fee_charges_waived_derived) AS "Total Fees Waived", Sum(l.penalty_charges_waived_derived) AS "Total Penalties Waived" FROM      m_office o JOIN      m_office ounder ON        ounder.hierarchy LIKE concat(o.hierarchy, ''%'') AND       ounder.hierarchy LIKE concat(''${currentUserHierarchy}'', ''%'') JOIN      m_client c ON        c.office_id = ounder.id JOIN      m_loan l ON        l.client_id = c.id JOIN      m_product_loan pl ON        pl.id = l.product_id LEFT JOIN m_staff lo ON        lo.id = l.loan_officer_id LEFT JOIN m_currency cur ON        cur.code = l.currency_code LEFT JOIN m_fund f ON        f.id = l.fund_id WHERE     o.id = ''${officeId}'' AND       ( l.currency_code = ''${currencyId}'' OR        ''-1'' = ''${currencyId}'') AND       ( l.product_id = ''${loanProductId}'' OR        ''-1'' = ''${loanProductId}'') AND       ( coalesce(l.loan_officer_id, -10) = ${loanOfficerId} OR        ''-1'' = ${loanOfficerId}) AND       ( coalesce(l.fund_id, -10) = ${fundId} OR        -1 = ${fundId}) AND       ( coalesce(l.loanpurpose_cv_id, -10) = ${loanPurposeId} OR        -1 = ${loanPurposeId}) AND       ( CASE WHEN ${obligDateType} = 1 THEN l.closedon_date BETWEEN ''${startDate}'' AND ''${endDate}'' WHEN ${obligDateType} = 2 THEN l.disbursedon_date BETWEEN ''${startDate}'' AND ''${endDate}'' ELSE 1 = 1 end) AND       l.loan_status_id = 600 GROUP BY  ounder.hierarchy, l.currency_code, ounder.name, cur.display_symbol ORDER BY  ounder.hierarchy, l.currency_code', 'Individual Client   Report', true, true, false);
INSERT INTO public.stretchy_report VALUES (15, 'Portfolio at Risk', 'Table', NULL, 'Loan', 'SELECT x."Currency", x."Principal Outstanding", x."Principal Overdue", x."Interest Outstanding", x."Interest Overdue", x."Fees Outstanding", x."Fees Overdue", x."Penalties Outstanding", x."Penalties Overdue", ( CASE WHEN ${parType} = 1 THEN cast(round((x."Principal Overdue" * 100) / x."Principal Outstanding", 2) AS CHAR) WHEN ${parType} = 2 THEN cast(round(((x."Principal Overdue" + x."Interest Overdue") * 100) / (x."Principal Outstanding" + x."Interest Outstanding"), 2) AS CHAR) WHEN ${parType} = 3 THEN cast(round(((x."Principal Overdue" + x."Interest Overdue" + x."Fees Overdue") * 100) / (x."Principal Outstanding" + x."Interest Outstanding" + x."Fees Outstanding"), 2) AS CHAR) WHEN ${parType} = 4 THEN cast(round(((x."Principal Overdue" + x."Interest Overdue" + x."Fees Overdue" + x."Penalties Overdue") * 100) / (x."Principal Outstanding" + x."Interest Outstanding" + x."Fees Outstanding" + x."Penalties Overdue"), 2) AS CHAR) ELSE ''invalid PAR Type'' end) AS "Portfolio at Risk %" FROM   ( SELECT    coalesce(cur.display_symbol, l.currency_code) AS "Currency", sum(l.principal_outstanding_derived)  AS "Principal Outstanding", sum(laa.principal_overdue_derived)  AS "Principal Overdue", sum(l.interest_outstanding_derived) AS "Interest Outstanding", sum(laa.interest_overdue_derived) AS "Interest Overdue", sum(l.fee_charges_outstanding_derived)  AS "Fees Outstanding", sum(laa.fee_charges_overdue_derived)  AS "Fees Overdue", sum(penalty_charges_outstanding_derived)  AS "Penalties Outstanding", sum(laa.penalty_charges_overdue_derived)  AS "Penalties Overdue" FROM      m_office o JOIN      m_office ounder ON        ounder.hierarchy LIKE concat(o.hierarchy, ''%'') AND       ounder.hierarchy LIKE concat(''${currentUserHierarchy}'', ''%'') JOIN      m_client c ON        c.office_id = ounder.id JOIN      m_loan l ON        l.client_id = c.id LEFT JOIN m_staff lo ON        lo.id = l.loan_officer_id LEFT JOIN m_currency cur ON        cur.code = l.currency_code LEFT JOIN m_fund f ON        f.id = l.fund_id LEFT JOIN m_code_value purp ON        purp.id = l.loanpurpose_cv_id LEFT JOIN m_product_loan p ON        p.id = l.product_id LEFT JOIN m_loan_arrears_aging laa ON        laa.loan_id = l.id WHERE     o.id = ''${officeId}'' AND       ( l.currency_code = ''${currencyId}'' OR        ''-1'' = ''${currencyId}'') AND       ( l.product_id = ''${loanProductId}'' OR        ''-1'' = ''${loanProductId}'') AND       ( coalesce(l.loan_officer_id, -10) = ${loanOfficerId} OR        ''-1'' = ${loanOfficerId}) AND       ( coalesce(l.fund_id, -10) = ${fundId} OR        -1 = ${fundId}) and (coalesce(l.loanpurpose_cv_id, -10) = ${loanPurposeId} OR        -1 = ${loanPurposeId}) AND       l.loan_status_id = 300 GROUP BY  l.currency_code, cur.display_symbol ORDER BY  l.currency_code) x', 'Covers all loans.    For larger MFIs … we should add some derived fields on loan (or a 1:1 loan related table like mifos 2.x does)  Principle, Interest, Fees, Penalties Outstanding and Overdue (possibly waived and written off too)', true, true, false);
INSERT INTO public.stretchy_report VALUES (16, 'Portfolio at Risk by Branch', 'Table', NULL, 'Loan', 'SELECT   Concat(REPEAT(''..'', ((Length(mo.hierarchy ) - Length(REPLACE(mo.hierarchy, ''.'', '''')) - 1))), mo.name) AS "Office/Branch", x."Currency", x."Principal Outstanding" , x."Principal Overdue", x."Interest Outstanding", x."Interest Overdue", x."Fees Outstanding", x."Fees Overdue", x."Penalties Outstanding", x."Penalties Overdue", ( CASE WHEN ${parType} = 1 THEN cast(round((x."Principal Overdue" * 100) / x."Principal Outstanding", 2) AS  CHAR) WHEN ${parType} = 2 THEN cast(round(((x."Principal Overdue" + x."Interest Overdue") * 100) / (x."Principal Outstanding" + x."Interest Outstanding"), 2) AS      CHAR) WHEN ${parType} = 3 THEN cast(round(((x."Principal Overdue" + x."Interest Overdue" + x."Fees Overdue") * 100) / (x."Principal Outstanding" + x."Interest Outstanding" + x."Fees Outstanding"), 2) AS CHAR) WHEN ${parType} = 4 THEN cast(round(((x."Principal Overdue" + x."Interest Overdue" + x."Fees Overdue" + x."Penalties Overdue") * 100) / (x."Principal Outstanding" + x."Interest Outstanding" + x."Fees Outstanding" + x."Penalties Overdue"), 2) AS           CHAR) ELSE ''invalid PAR Type'' end) AS "Portfolio at Risk %" FROM     m_office mo JOIN ( SELECT    ounder.id  AS "branch", coalesce(cur.display_symbol, l.currency_code) AS "Currency", sum(l.principal_outstanding_derived)  AS "Principal Outstanding", sum(laa.principal_overdue_derived)  AS "Principal Overdue", sum(l.interest_outstanding_derived) AS "Interest Outstanding", sum(laa.interest_overdue_derived) AS "Interest Overdue", sum(l.fee_charges_outstanding_derived)  AS "Fees Outstanding", sum(laa.fee_charges_overdue_derived)  AS "Fees Overdue", sum(penalty_charges_outstanding_derived)  AS "Penalties Outstanding", sum(laa.penalty_charges_overdue_derived)  AS "Penalties Overdue" FROM      m_office o JOIN      m_office ounder ON        ounder.hierarchy LIKE concat(o.hierarchy, ''%'') AND       ounder.hierarchy LIKE concat(''${currentUserHierarchy}'', ''%'') JOIN      m_client c ON        c.office_id = ounder.id JOIN      m_loan l ON        l.client_id = c.id LEFT JOIN m_staff lo ON        lo.id = l.loan_officer_id LEFT JOIN m_currency cur ON        cur.code = l.currency_code LEFT JOIN m_fund f ON        f.id = l.fund_id LEFT JOIN m_code_value purp ON        purp.id = l.loanpurpose_cv_id LEFT JOIN m_product_loan p ON        p.id = l.product_id LEFT JOIN m_loan_arrears_aging laa ON        laa.loan_id = l.id WHERE     o.id = ''${officeId}'' AND       ( l.currency_code = ''${currencyId}'' OR        ''-1'' = ''${currencyId}'') AND       ( l.product_id = ''${loanProductId}'' OR        ''-1'' = ''${loanProductId}'') AND       ( coalesce(l.loan_officer_id, -10) = ${loanOfficerId} OR        ''-1'' = ${loanOfficerId}) AND       ( coalesce(l.fund_id, -10) = ${fundId} OR        -1 = ${fundId}) and (coalesce(l.loanpurpose_cv_id, -10) = ${loanPurposeId} OR        -1 = ${loanPurposeId}) AND       l.loan_status_id = 300 GROUP BY  ounder.id, l.currency_code, cur.display_symbol ) x ON       x.branch = mo.id ORDER BY mo.hierarchy, x."Currency"', 'Covers all loans.    For larger MFIs … we should add some derived fields on loan (or a 1:1 loan related table like mifos 2.x does)  Principle, Interest, Fees, Penalties Outstanding and Overdue (possibly waived and written off too)', true, true, false);
INSERT INTO public.stretchy_report VALUES (20, 'Funds Disbursed Between Dates Summary', 'Table', NULL, 'Fund', 'SELECT    Coalesce(f.name, ''-'') AS fund, Coalesce(cur.display_symbol, l.currency_code) AS currency, Round(Sum(l.principal_amount), 4) AS disbursed_amount FROM      m_office ounder JOIN      m_client c ON        c.office_id = ounder.id JOIN      m_loan l ON        l.client_id = c.id JOIN      m_currency cur ON        cur.code = l.currency_code LEFT JOIN m_fund f ON        f.id = l.fund_id WHERE     disbursedon_date BETWEEN ''${startDate}'' AND ''${endDate}'' AND       ( coalesce(l.fund_id, -10) = ${fundId} OR        -1 = ${fundId}) AND       ( l.currency_code = ''${currencyId}'' OR        ''-1'' = ''${currencyId}'') AND       ounder.hierarchy LIKE concat(''${currentUserHierarchy}'', ''%'') GROUP BY  coalesce(f.name, ''-'') , coalesce(cur.display_symbol, l.currency_code) ORDER BY  coalesce(f.name, ''-'') , coalesce(cur.display_symbol, l.currency_code)', NULL, true, true, false);
INSERT INTO public.stretchy_report VALUES (21, 'Funds Disbursed Between Dates Summary by Office', 'Table', NULL, 'Fund', 'SELECT    Concat(REPEAT(''..'', ((Length(ounder.hierarchy) - Length(REPLACE(ounder.hierarchy, ''.'', '''')) - 1))), ounder.name) AS "Office/Branch", Coalesce(f.name, ''-'')  AS fund, Coalesce(cur.display_symbol, l.currency_code)  AS currency, Round(Sum(l.principal_amount), 4)  AS disbursed_amount FROM      m_office o JOIN      m_office ounder ON        ounder.hierarchy LIKE Concat(o.hierarchy, ''%'') AND       ounder.hierarchy LIKE Concat(''${currentUserHierarchy}'', ''%'') JOIN      m_client c ON        c.office_id = ounder.id JOIN      m_loan l ON        l.client_id = c.id JOIN      m_currency cur ON        cur.code = l.currency_code LEFT JOIN m_fund f ON        f.id = l.fund_id WHERE     disbursedon_date BETWEEN ''${startDate}'' AND ''${endDate}'' AND       o.id = ''${officeId}'' AND       ( coalesce(l.fund_id, -10) = ${fundId} OR        -1 = ${fundId}) AND       ( l.currency_code = ''${currencyId}'' OR        ''-1'' = ''${currencyId}'') GROUP BY  ounder.name, coalesce(f.name, ''-'') , coalesce(cur.display_symbol, l.currency_code), ounder.hierarchy ORDER BY  ounder.name, coalesce(f.name, ''-'') , coalesce(cur.display_symbol, l.currency_code)', NULL, true, true, false);
