INSERT INTO public.stretchy_report VALUES (51, 'Written-Off Loans', 'Table', NULL, 'Loan', 'SELECT    Concat(REPEAT(''..'', ((Length(ounder.hierarchy) - Length(REPLACE(ounder.hierarchy, ''.'', '''')) - 1))), ounder.name) AS "Office/Branch", Coalesce(cur.display_symbol, ml.currency_code) AS currency, c.account_no AS "Client Account No.", c.display_name AS "Client Name", ml.account_no  AS "Loan Account No.", mpl.name AS "Product Name", ml.disbursedon_date  AS "Disbursed Date", lt.transaction_date  AS "Written Off date", ml.principal_amount  AS "Loan Amount", Coalesce(lt.principal_portion_derived, 0)  AS "Written-Off                    Principal", Coalesce(lt.interest_portion_derived, 0) AS "Written-Off Interest", Coalesce(lt.fee_charges_portion_derived,0) AS "Written-Off                    Fees", Coalesce(lt.penalty_charges_portion_derived,0) AS "Written-Off Penalties", n.note AS "Reason For Write-Off", Coalesce(ms.display_name,''-'')  AS "Loan Officer Name" FROM      m_office o JOIN      m_office ounder ON        ounder.hierarchy LIKE Concat(o.hierarchy, ''%'') AND       ounder.hierarchy LIKE Concat(''${currentUserHierarchy}'', ''%'') JOIN      m_client c ON        c.office_id = ounder.id JOIN      m_loan ml ON        ml.client_id = c.id JOIN      m_product_loan mpl ON        mpl.id=ml.product_id LEFT JOIN m_staff ms ON        ms.id=ml.loan_officer_id JOIN      m_loan_transaction lt ON        lt.loan_id = ml.id LEFT JOIN m_note n ON        n.loan_transaction_id = lt.id LEFT JOIN m_currency cur ON        cur.code = ml.currency_code WHERE     lt.transaction_type_enum = 6 /*write-off */ AND       lt.is_reversed IS FALSE AND       ml.loan_status_id=601 AND       o.id=''${officeId}'' AND       ( mpl.id=''${loanProductId}'' OR        ''${loanProductId}''=-1) AND       lt.transaction_date BETWEEN ''${startDate}'' AND ''${endDate}'' AND       ( ml.currency_code = ''${currencyId}'' OR        ''-1'' = ''${currencyId}'') ORDER BY  ounder.hierarchy, coalesce(cur.display_symbol, ml.currency_code), ml.account_no', 'Individual Lending Report. Written Off Loans', true, true, false);
INSERT INTO public.stretchy_report VALUES (52, 'Aging Detail', 'Table', NULL, 'Loan', 'SELECT     Concat(Repeat(''..'', ((Length(ounder.hierarchy) - Length(Replace(ounder.hierarchy , ''.'', '''')) - 1))), ounder.NAME) AS "Office/Branch", COALESCE(cur.display_symbol, ml.currency_code)  AS currency, mc.account_no AS "Client Account No.", mc.display_name  AS "Client Name", ml.account_no  AS "Account Number", ml.principal_amount  AS "Loan Amount", ml.principal_disbursed_derived  AS "Original Principal", ml.interest_charged_derived AS "Original Interest", ml.principal_repaid_derived AS "Principal Paid", ml.interest_repaid_derived  AS "Interest Paid", laa.principal_overdue_derived AS "Principal Overdue", laa.interest_overdue_derived  AS "Interest Overdue", Extract(day FROM (CURRENT_DATE::timestamp - laa.overdue_since_date_derived::timestamp))  AS "Days in Arrears", CASE WHEN Extract(day FROM (CURRENT_DATE::timestamp - laa.overdue_since_date_derived::timestamp))<7 THEN ''<1'' WHEN extract(day FROM (CURRENT_DATE::timestamp - laa.overdue_since_date_derived::timestamp))<8 THEN '' 1'' WHEN extract(day FROM (CURRENT_DATE::timestamp - laa.overdue_since_date_derived::timestamp))<15 THEN ''2'' WHEN extract(day FROM (CURRENT_DATE::timestamp - laa.overdue_since_date_derived::timestamp))<22 THEN '' 3'' WHEN extract(day FROM (CURRENT_DATE::timestamp - laa.overdue_since_date_derived::timestamp))<29 THEN '' 4'' WHEN extract(day FROM (CURRENT_DATE::timestamp - laa.overdue_since_date_derived::timestamp))<36 THEN '' 5'' WHEN extract(day FROM (CURRENT_DATE::timestamp - laa.overdue_since_date_derived::timestamp))<43 THEN '' 6'' WHEN extract(day FROM (CURRENT_DATE::timestamp - laa.overdue_since_date_derived::timestamp))<50 THEN '' 7'' WHEN extract(day FROM (CURRENT_DATE::timestamp - laa.overdue_since_date_derived::timestamp))<57 THEN '' 8'' WHEN extract(day FROM (CURRENT_DATE::timestamp - laa.overdue_since_date_derived::timestamp))<64 THEN '' 9'' WHEN extract(day FROM (CURRENT_DATE::timestamp - laa.overdue_since_date_derived::timestamp))<71 THEN ''10'' WHEN extract(day FROM (CURRENT_DATE::timestamp - laa.overdue_since_date_derived::timestamp))<78 THEN ''11'' WHEN extract(day FROM (CURRENT_DATE::timestamp - laa.overdue_since_date_derived::timestamp))<85 THEN ''12'' ELSE ''12+'' END AS "Weeks In Arrears Band", CASE WHEN extract(day FROM (CURRENT_DATE::timestamp - laa.overdue_since_date_derived::timestamp))<31 THEN ''0 - 30'' WHEN extract(day FROM (CURRENT_DATE::timestamp - laa.overdue_since_date_derived::timestamp))<61 THEN ''30 - 60'' WHEN extract(day FROM (CURRENT_DATE::timestamp - laa.overdue_since_date_derived::timestamp))<91 THEN ''60 - 90'' WHEN extract(day FROM (CURRENT_DATE::timestamp - laa.overdue_since_date_derived::timestamp))<181 THEN ''90 - 180'' WHEN extract(day FROM (CURRENT_DATE::timestamp - laa.overdue_since_date_derived::timestamp))<361 THEN ''180 - 360'' ELSE ''> 360'' END AS "Days in Arrears Band" FROM       m_office mo JOIN       m_office ounder ON         ounder.hierarchy LIKE concat(mo.hierarchy, ''%'') AND        ounder.hierarchy LIKE concat(''${currentUserHierarchy}'', ''%'') INNER JOIN m_client mc ON         mc.office_id=ounder.id INNER JOIN m_loan ml ON         ml.client_id = mc.id INNER JOIN r_enum_value rev ON         rev.enum_id=ml.loan_status_id AND        rev.enum_name = ''loan_status_id'' INNER JOIN m_loan_arrears_aging laa ON         laa.loan_id=ml.id LEFT JOIN  m_currency cur ON         cur.code = ml.currency_code WHERE      ml.loan_status_id=300 AND        mo.id=''${officeId}'' GROUP BY   ounder.hierarchy, ounder.name, cur.display_symbol, ml.currency_code, mc.account_no, mc.display_name, ml.account_no, ml.principal_amount, ml.principal_disbursed_derived, ml.interest_charged_derived, ml.principal_repaid_derived, ml.interest_repaid_derived, laa.principal_overdue_derived, laa.interest_overdue_derived, laa.overdue_since_date_derived ORDER BY   ounder.hierarchy, COALESCE(cur.display_symbol, ml.currency_code), ml.account_no', 'Loan arrears aging (Weeks)', true, true, false);
INSERT INTO public.stretchy_report VALUES (53, 'Aging Summary (Arrears in Weeks)', 'Table', NULL, 'Loan', 'SELECT    Coalesce(periods.currencyname, periods.currency) AS currency, periods.period_no AS "Weeks In Arrears (Up To)", coalesce(ars.loanid, 0) AS "No Of Loans", coalesce(ars.principal,0.0) AS "Original Principal", coalesce(ars.interest,0.0) AS "Original Interest", coalesce(ars.prinpaid,0.0) AS "Principal Paid", coalesce(ars.intpaid,0.0) AS "Interest Paid", coalesce(ars.prinoverdue,0.0) AS "Principal Overdue", coalesce(ars.intoverdue,0.0) AS "Interest Overdue" FROM      ( SELECT curs.code AS currency, curs.name AS currencyname, pers.* FROM   ( SELECT ''On Schedule'' period_no, 1             pid UNION SELECT ''1'', 2 UNION SELECT ''2'', 3 UNION SELECT ''3'', 4 UNION SELECT ''4'', 5 UNION SELECT ''5'', 6 UNION SELECT ''6'', 7 UNION SELECT ''7'', 8 UNION SELECT ''8'', 9 UNION SELECT ''9'', 10 UNION SELECT ''10'', 11 UNION SELECT ''11'', 12 UNION SELECT ''12'', 13 UNION SELECT ''12+'', 14) pers, ( SELECT     DISTINCT ON (moc.code) moc.code, moc.name FROM       m_office mo2 INNER JOIN m_office ounder2 ON         ounder2.hierarchy LIKE concat(mo2.hierarchy, ''%'') AND        ounder2.hierarchy LIKE concat(''${currentUserHierarchy}'', ''%'') INNER JOIN m_client mc2 ON         mc2.office_id=ounder2.id INNER JOIN m_loan ml2 ON         ml2.client_id = mc2.id INNER JOIN m_organisation_currency moc ON         moc.code = ml2.currency_code WHERE      ml2.loan_status_id=300 /* active */ AND        mo2.id=''${officeId}'' AND        ( ml2.currency_code = ''${currencyId}'' OR         ''-1'' = ''${currencyId}'') GROUP BY moc.code, moc.name) curs) periods LEFT JOIN ( SELECT   z.currency, z.arrperiod, count(z.loanid)  AS loanid, sum(z.principal) AS principal, sum(z.interest)  AS interest, sum(z.prinpaid)  AS prinpaid, sum(z.intpaid) AS intpaid, sum(z.prinoverdue) AS prinoverdue, sum(z.intoverdue)  AS intoverdue FROM     ( SELECT x.loanid, x.currency, x.principal, x.interest, x.prinpaid, x.intpaid, x.prinoverdue, x.intoverdue, CASE WHEN extract(day FROM (CURRENT_DATE::TIMESTAMP - MINOVERDUEDATE::TIMESTAMP))<1 THEN ''On Schedule'' WHEN extract(day FROM (CURRENT_DATE::TIMESTAMP - MINOVERDUEDATE::TIMESTAMP))<8 THEN ''1'' WHEN extract(day FROM (CURRENT_DATE::TIMESTAMP - MINOVERDUEDATE::TIMESTAMP))<15 THEN ''2'' WHEN extract(day FROM (CURRENT_DATE::TIMESTAMP - MINOVERDUEDATE::TIMESTAMP))<22 THEN ''3'' WHEN extract(day FROM (CURRENT_DATE::TIMESTAMP - MINOVERDUEDATE::TIMESTAMP))<29 THEN ''4'' WHEN extract(day FROM (CURRENT_DATE::TIMESTAMP - MINOVERDUEDATE::TIMESTAMP))<36 THEN ''5'' WHEN extract(day FROM (CURRENT_DATE::TIMESTAMP - MINOVERDUEDATE::TIMESTAMP))<43 THEN ''6'' WHEN extract(day FROM (CURRENT_DATE::TIMESTAMP - MINOVERDUEDATE::TIMESTAMP))<50 THEN ''7'' WHEN extract(day FROM (CURRENT_DATE::TIMESTAMP - MINOVERDUEDATE::TIMESTAMP))<57 THEN ''8'' WHEN extract(day FROM (CURRENT_DATE::TIMESTAMP - MINOVERDUEDATE::TIMESTAMP))<64 THEN ''9'' WHEN extract(day FROM (CURRENT_DATE::TIMESTAMP - MINOVERDUEDATE::TIMESTAMP))<71 THEN ''10'' WHEN extract(day FROM (CURRENT_DATE::TIMESTAMP - MINOVERDUEDATE::TIMESTAMP))<78 THEN ''11'' WHEN extract(day FROM (CURRENT_DATE::TIMESTAMP - MINOVERDUEDATE::TIMESTAMP))<85 THEN ''12'' ELSE ''12+'' end AS arrperiod FROM   ( SELECT     ml.id  AS loanid, ml.currency_code AS currency, ml.principal_disbursed_derived AS principal, ml.interest_charged_derived  AS interest, ml.principal_repaid_derived  AS prinpaid, ml.interest_repaid_derived  AS intpaid, laa.principal_overdue_derived  AS prinoverdue, laa.interest_overdue_derived AS intoverdue, coalesce(laa.overdue_since_date_derived, CURRENT_DATE) AS minoverduedate FROM       m_office mo INNER JOIN m_office ounder ON         ounder.hierarchy LIKE concat(mo.hierarchy, ''%'') AND        ounder.hierarchy LIKE concat(''${currentUserHierarchy}'', ''%'') INNER JOIN m_client mc ON         mc.office_id=ounder.id INNER JOIN m_loan ml ON         ml.client_id = mc.id LEFT JOIN  m_loan_arrears_aging laa ON         laa.loan_id = ml.id WHERE      ml.loan_status_id=300 AND        mo.id=''${officeId}'' AND        ( ml.currency_code = ''${currencyId}'' OR         ''-1'' = ''${currencyId}'') GROUP BY   ml.id, laa.principal_overdue_derived, laa.interest_overdue_derived, laa.overdue_since_date_derived) x ) z GROUP BY z.currency, z.arrperiod ) ars ON        ars.arrperiod=periods.period_no AND       ars.currency = periods.currency ORDER BY  periods.currency, periods.pid', 'Loan amount in arrears by branch', true, true, false);
INSERT INTO public.stretchy_report VALUES (54, 'Rescheduled Loans', 'Table', NULL, 'Loan', 'SELECT    Concat(REPEAT(''..'', ((Length(ounder.hierarchy) - Length(REPLACE(ounder.hierarchy, ''.'', '''')) - 1))), ounder.name) AS "Office/Branch", Coalesce(cur.display_symbol, ml.currency_code) AS currency, c.account_no AS "Client Account No.", c.display_name AS "Client Name", ml.account_no  AS "Loan Account No.", mpl.name AS "Product Name", ml.disbursedon_date  AS "Disbursed Date", lt.transaction_date  AS "Written Off date", ml.principal_amount  AS "Loan Amount", Coalesce(lt.principal_portion_derived, 0)  AS "Rescheduled Principal", Coalesce(lt.interest_portion_derived, 0) AS "Rescheduled Interest", Coalesce(lt.fee_charges_portion_derived,0) AS "Rescheduled Fees", Coalesce(lt.penalty_charges_portion_derived,0) AS "Rescheduled Penalties", n.note AS "Reason For Rescheduling", Coalesce(ms.display_name,''-'')  AS "Loan Officer Name" FROM      m_office o JOIN      m_office ounder ON        ounder.hierarchy LIKE Concat(o.hierarchy, ''%'') AND       ounder.hierarchy LIKE Concat(''${currentUserHierarchy}'', ''%'') JOIN      m_client c ON        c.office_id = ounder.id JOIN      m_loan ml ON        ml.client_id = c.id JOIN      m_product_loan mpl ON        mpl.id=ml.product_id LEFT JOIN m_staff ms ON        ms.id=ml.loan_officer_id JOIN      m_loan_transaction lt ON        lt.loan_id = ml.id LEFT JOIN m_note n ON        n.loan_transaction_id = lt.id LEFT JOIN m_currency cur ON        cur.code = ml.currency_code WHERE     lt.transaction_type_enum = 7 /*marked for rescheduling */ AND       lt.is_reversed IS FALSE AND       ml.loan_status_id=602 AND       o.id=''${officeId}'' AND       ( mpl.id=''${loanProductId}'' OR        ''${loanProductId}''=-1) AND       lt.transaction_date BETWEEN ''${startDate}'' AND ''${endDate}'' AND       ( ml.currency_code = ''${currencyId}'' OR        ''-1'' = ''${currencyId}'') ORDER BY  ounder.hierarchy, coalesce(cur.display_symbol, ml.currency_code), ml.account_no', 'Individual Lending Report. Rescheduled Loans.  The ability to reschedule (or mark that you have rescheduled the loan elsewhere) is a legacy of the older Mifos product.  Needed for migration.', true, true, false);
INSERT INTO public.stretchy_report VALUES (55, 'Active Loans Passed Final Maturity', 'Table', NULL, 'Loan', 'SELECT    Concat(REPEAT(''..'', ((Length(ounder.hierarchy) - Length(REPLACE(ounder.hierarchy, ''.'', '''')) - 1))), ounder.name) AS "Office/Branch", Coalesce(cur.display_symbol, l.currency_code)  AS currency, lo.display_name  AS "Loan Officer", c.display_name AS "Client", l.account_no AS "Loan Account No.", pl.name  AS "Product", f.name AS fund, l.principal_amount AS "Loan Amount", l.annual_nominal_interest_rate AS "Annual Nominal Interest Rate", DATE_TRUNC(''day'', l.disbursedon_date)  AS "Disbursed Date", DATE_TRUNC(''day'', l.expected_maturedon_date) AS "Expected Matured On", l.principal_repaid_derived AS "Principal Repaid", l.principal_outstanding_derived  AS "Principal Outstanding", laa.principal_overdue_derived  AS "Principal Overdue", l.interest_repaid_derived  AS "Interest Repaid", l.interest_outstanding_derived AS "Interest Outstanding", laa.interest_overdue_derived AS "Interest Overdue", l.fee_charges_repaid_derived AS "Fees Repaid", l.fee_charges_outstanding_derived  AS "Fees Outstanding", laa.fee_charges_overdue_derived  AS "Fees Overdue", l.penalty_charges_repaid_derived AS "Penalties Repaid", l.penalty_charges_outstanding_derived  AS "Penalties Outstanding", laa.penalty_charges_overdue_derived  AS "Penalties Overdue" FROM      m_office o JOIN      m_office ounder ON        ounder.hierarchy LIKE Concat(o.hierarchy, ''%'') AND       ounder.hierarchy LIKE Concat(''${currentUserHierarchy}'', ''%'') JOIN      m_client c ON        c.office_id = ounder.id JOIN      m_loan l ON        l.client_id = c.id JOIN      m_product_loan pl ON        pl.id = l.product_id LEFT JOIN m_staff lo ON        lo.id = l.loan_officer_id LEFT JOIN m_currency cur ON        cur.code = l.currency_code LEFT JOIN m_fund f ON        f.id = l.fund_id LEFT JOIN m_loan_arrears_aging laa ON        laa.loan_id = l.id WHERE     o.id = ''${officeId}'' AND       ( l.currency_code = ''${currencyId}'' OR        ''-1'' = ''${currencyId}'') AND       ( l.product_id = ''${loanProductId}'' OR        ''-1'' = ''${loanProductId}'') AND       ( Coalesce(l.loan_officer_id, -10) = ${loanOfficerId} OR        ''-1'' = ${loanOfficerId}) AND       ( coalesce(l.fund_id, -10) = ${fundId} OR        -1 = ${fundId}) AND       ( coalesce(l.loanpurpose_cv_id, -10) = ${loanPurposeId} OR        -1 = ${loanPurposeId}) AND       l.loan_status_id = 300 AND       l.expected_maturedon_date < CURRENT_DATE GROUP BY  l.id, ounder.hierarchy, ounder.name, cur.display_symbol, lo.display_name, c.display_name, f.name, pl.name, laa.principal_overdue_derived, laa.interest_overdue_derived, laa.fee_charges_overdue_derived, laa.penalty_charges_overdue_derived, c.account_no ORDER BY  ounder.hierarchy, l.currency_code, c.account_no, l.account_no', 'Individual Client   Report', true, true, false);
INSERT INTO public.stretchy_report VALUES (56, 'Active Loans Passed Final Maturity Summary', 'Table', NULL, 'Loan', 'SELECT   Concat(REPEAT(''..'', ((Length(mo.hierarchy ) - Length(REPLACE(mo.hierarchy, ''.'', '''')) - 1))), mo.name) AS "Office/Branch", x.currency  AS currency, x.client_count  AS "No. of Clients", x.active_loan_count AS "No. Active                    Loans", x. arrears_loan_count AS "No. of Loans in Arrears", x.principal AS "Total Loans Disbursed", x.principal_repaid  AS "Principal Repaid", x.principal_outstanding AS "Principal Outstanding", x.principal_overdue AS "Principal Overdue", x.interest  AS "Total Interest", x.interest_repaid AS "Interest Repaid", x.interest_outstanding  AS "Interest Outstanding", x.interest_overdue  AS "Interest Overdue", x.fees  AS "Total Fees", x.fees_repaid AS "Fees Repaid", x.fees_outstanding  AS "Fees Outstanding", x.fees_overdue  AS "Fees Overdue", x.penalties AS "Total Penalties", x.penalties_repaid  AS "Penalties Repaid", x.penalties_outstanding AS "Penalties Outstanding", x.penalties_overdue AS "Penalties Overdue", ( CASE WHEN ${parType} = 1 THEN cast(round((x.principal_overdue * 100) / x.principal_outstanding, 2) AS                                                                                                                                     CHAR) WHEN ${parType} = 2 THEN cast(round(((x.principal_overdue + x.interest_overdue) * 100) / (x.principal_outstanding + x.interest_outstanding), 2) AS                                                                                   CHAR) WHEN ${parType} = 3 THEN cast(round(((x.principal_overdue + x.interest_overdue + x.fees_overdue) * 100) / (x.principal_outstanding + x.interest_outstanding + x.fees_outstanding), 2) AS                                             CHAR) WHEN ${parType} = 4 THEN cast(round(((x.principal_overdue + x.interest_overdue + x.fees_overdue + x.penalties_overdue) * 100) / (x.principal_outstanding + x.interest_outstanding + x.fees_outstanding + x.penalties_overdue), 2) AS CHAR) ELSE ''invalid PAR Type'' end) AS "Portfolio at Risk %" FROM     m_office mo JOIN ( SELECT    ounder.id  AS branch, coalesce(cur.display_symbol, l.currency_code)  AS currency, count(DISTINCT(c.id))  AS client_count, count(DISTINCT(l.id))  AS active_loan_count, count(DISTINCT(laa.loan_id) )  AS arrears_loan_count, sum(l.principal_disbursed_derived) AS principal, sum(l.principal_repaid_derived)  AS principal_repaid, sum(l.principal_outstanding_derived) AS principal_outstanding, sum(coalesce(laa.principal_overdue_derived,0)) AS principal_overdue, sum(l.interest_charged_derived)  AS interest, sum(l.interest_repaid_derived) AS interest_repaid, sum(l.interest_outstanding_derived)  AS interest_outstanding, sum(coalesce(laa.interest_overdue_derived,0))  AS interest_overdue, sum(l.fee_charges_charged_derived) AS fees, sum(l.fee_charges_repaid_derived)  AS fees_repaid, sum(l.fee_charges_outstanding_derived) AS fees_outstanding, sum(coalesce(laa.fee_charges_overdue_derived,0)) AS fees_overdue, sum(l.penalty_charges_charged_derived) AS penalties, sum(l.penalty_charges_repaid_derived)  AS penalties_repaid, sum(l.penalty_charges_outstanding_derived) AS penalties_outstanding, sum(coalesce(laa.penalty_charges_overdue_derived,0)) AS penalties_overdue FROM      m_office o JOIN      m_office ounder ON        ounder.hierarchy LIKE concat(o.hierarchy, ''%'') AND       ounder.hierarchy LIKE concat(''${currentUserHierarchy}'', ''%'') JOIN      m_client c ON        c.office_id = ounder.id JOIN      m_loan l ON        l.client_id = c.id LEFT JOIN m_currency cur ON        cur.code = l.currency_code LEFT JOIN m_loan_arrears_aging laa ON        laa.loan_id = l.id WHERE     o.id = ''${officeId}'' AND       ( l.currency_code = ''${currencyId}'' OR        ''-1'' = ''${currencyId}'') AND       ( l.product_id = ''${loanProductId}'' OR        ''-1'' = ''${loanProductId}'') AND       ( coalesce(l.loan_officer_id, -10) = ${loanOfficerId} OR        ''-1'' = ${loanOfficerId}) AND       ( coalesce(l.fund_id, -10) = ${fundId} OR        -1 = ${fundId}) and (coalesce(l.loanpurpose_cv_id, -10) = ${loanPurposeId} OR        -1 = ${loanPurposeId}) AND       l.loan_status_id = 300 AND       l.expected_maturedon_date < CURRENT_DATE GROUP BY  ounder.id, cur.display_symbol, l.currency_code) x ON       x.branch = mo.id ORDER BY mo.hierarchy, x.currency', NULL, true, true, false);
INSERT INTO public.stretchy_report VALUES (57, 'Active Loans in last installment', 'Table', NULL, 'Loan', 'SELECT    Concat(REPEAT(''..'', ((Length(lastinstallment.hierarchy) - Length(REPLACE(lastinstallment.hierarchy, ''.'', '''')) - 1))), lastinstallment.branch) AS "Office/Branch", lastinstallment.currency, lastinstallment."Loan Officer", lastinstallment."Client Account No", lastinstallment."Client", lastinstallment."Loan Account No", lastinstallment."Product", lastinstallment."Fund", lastinstallment."Loan Amount", lastinstallment."Annual Nominal Interest Rate", lastinstallment."Disbursed", lastinstallment."Expected Matured On" , l.principal_repaid_derived  AS "Principal Repaid", l.principal_outstanding_derived AS "Principal Outstanding", laa.principal_overdue_derived AS "Principal Overdue", l.interest_repaid_derived AS "Interest Repaid", l.interest_outstanding_derived  AS "Interest Outstanding", laa.interest_overdue_derived  AS "Interest Overdue", l.fee_charges_repaid_derived  AS "Fees Repaid", l.fee_charges_outstanding_derived AS "Fees Outstanding", laa.fee_charges_overdue_derived AS "Fees Overdue", l.penalty_charges_repaid_derived  AS "Penalties Repaid", l.penalty_charges_outstanding_derived AS "Penalties Outstanding", laa.penalty_charges_overdue_derived AS "Penalties Overdue" FROM      ( SELECT    l.id AS loanid, l.number_of_repayments, Min(r.installment), ounder.id, ounder.hierarchy, ounder.name AS branch, Coalesce(cur.display_symbol, l.currency_code) AS currency, lo.display_name AS "Loan Officer", c.account_no  AS "Client Account No", c.display_name  AS "Client", l.account_no  AS "Loan Account No", pl.name AS "Product", f.name  AS "Fund", l.principal_amount  AS "Loan Amount", l.annual_nominal_interest_rate  AS "Annual Nominal Interest Rate", DATE_TRUNC(''day'', l.disbursedon_date) AS "Disbursed", DATE_TRUNC(''day'', l.expected_maturedon_date)  AS "Expected Matured On" FROM      m_office o JOIN      m_office ounder ON        ounder.hierarchy LIKE Concat(o.hierarchy, ''%'') AND       ounder.hierarchy LIKE Concat(''${currentUserHierarchy}'', ''%'') JOIN      m_client c ON        c.office_id = ounder.id JOIN      m_loan l ON        l.client_id = c.id JOIN      m_product_loan pl ON        pl.id = l.product_id LEFT JOIN m_staff lo ON        lo.id = l.loan_officer_id LEFT JOIN m_currency cur ON        cur.code = l.currency_code LEFT JOIN m_fund f ON        f.id = l.fund_id LEFT JOIN m_loan_repayment_schedule r ON        r.loan_id = l.id WHERE     o.id = ''${officeId}'' AND       ( l.currency_code = ''${currencyId}'' OR        ''-1'' = ''${currencyId}'') AND       ( l.product_id = ''${loanProductId}'' OR        ''-1'' = ''${loanProductId}'') AND       ( Coalesce(l.loan_officer_id, -10) = ${loanOfficerId} OR        ''-1'' = ${loanOfficerId}) AND       ( coalesce(l.fund_id, -10) = ${fundId} OR        -1 = ${fundId}) AND       ( coalesce(l.loanpurpose_cv_id, -10) = ${loanPurposeId} OR        -1 = ${loanPurposeId}) AND       l.loan_status_id = 300 AND       r.completed_derived IS FALSE AND       r.duedate >= CURRENT_DATE GROUP BY  l.id, ounder.id, cur.display_symbol, lo.display_name, c.account_no, c.display_name, pl.name, f.name HAVING    l.number_of_repayments = min(r.installment)) lastinstallment JOIN      m_loan l ON        l.id = lastinstallment.loanid LEFT JOIN m_loan_arrears_aging laa ON        laa.loan_id = l.id ORDER BY  lastinstallment.hierarchy, lastinstallment.currency, lastinstallment."Client Account No", lastinstallment."Loan Account No"', 'Individual Client   Report', true, true, false);
INSERT INTO public.stretchy_report VALUES (113, 'ProgramDirectorStats', 'Table', NULL, 'Quipo', 'SELECT    Coalesce(cur.display_symbol, l.currency_code) AS currency, /*This query will return more than one entry if more than one currency is used */ Count(DISTINCT(c.id))  AS activeclients, Count(*) AS activeloans, Sum(l.principal_disbursed_derived) AS disbursedamount, Sum(l.principal_outstanding_derived) AS loanoutstandingamount, Round((Sum(l.principal_outstanding_derived) * 100) / Sum(l.principal_disbursed_derived),2) AS loanoutstandingpc, Sum(Coalesce(lpa.principal_in_advance_derived,0.0))  AS loanpaidinadvance, sum( CASE WHEN ( CURRENT_DATE - 28 * INTERVAL ''1 day'') > coalesce(laa.overdue_since_date_derived, CURRENT_DATE) THEN l.principal_outstanding_derived ELSE 0 end) AS portfolioatrisk, round((sum( CASE WHEN ( CURRENT_DATE - 28 * INTERVAL ''1 day'' ) > coalesce(laa.overdue_since_date_derived, CURRENT_DATE) THEN l.principal_outstanding_derived ELSE 0 end) * 100) / sum(l.principal_outstanding_derived), 2) AS portfolioatriskpc, count(DISTINCT( CASE WHEN ( CURRENT_DATE - 28 * INTERVAL ''1 day'' ) > coalesce(laa.overdue_since_date_derived, CURRENT_DATE) THEN c.id ELSE NULL end)) AS clientsindefault, round((count(DISTINCT( CASE WHEN ( CURRENT_DATE - 28 * INTERVAL ''1 day'' ) > coalesce(laa.overdue_since_date_derived, CURRENT_DATE) THEN c.id ELSE NULL end)) * 100) / count(DISTINCT(c.id)), 2)  AS clientsindefaultpc, (sum(l.principal_disbursed_derived) / count(*)) AS averageloanamount FROM      m_staff pd JOIN      m_staff bm ON        bm.organisational_role_parent_staff_id = pd.id JOIN      m_staff coord ON        coord.organisational_role_parent_staff_id = bm.id JOIN      m_staff fa ON        fa.organisational_role_parent_staff_id = coord.id JOIN      m_office o ON        o.id = fa.office_id AND       o.hierarchy LIKE concat(''${currentUserHierarchy}'', ''%'') JOIN      m_group pgm ON        pgm.staff_id = fa.id JOIN      m_loan l ON        l.group_id = pgm.id AND       l.client_id IS NOT NULL LEFT JOIN m_currency cur ON        cur.code = l.currency_code LEFT JOIN m_loan_arrears_aging laa ON        laa.loan_id = l.id LEFT JOIN m_loan_paid_in_advance lpa ON        lpa.loan_id = l.id JOIN      m_client c ON        c.id = l.client_id WHERE     pd.id = ${staffId} AND       l.loan_status_id = 300 GROUP BY  l.currency_code, cur.display_symbol', 'Program DirectorStatistics', false, false, false);
INSERT INTO public.stretchy_report VALUES (58, 'Active Loans in last installment Summary', 'Table', NULL, 'Loan', 'SELECT   Concat(REPEAT(''..'', ((Length(mo.hierarchy ) - Length(REPLACE(mo.hierarchy, ''.'', '''')) - 1))), mo.name) AS "Office/Branch", x.currency  AS currency, x.client_count  AS "No. of Clients", x.active_loan_count AS "No. Active Loans", x. arrears_loan_count AS "No. of Loans in Arrears", x.principal AS "Total Loans Disbursed", x.principal_repaid  AS "Principal Repaid", x.principal_outstanding AS "Principal Outstanding", x.principal_overdue AS "Principal Overdue", x.interest  AS "Total Interest", x.interest_repaid AS "Interest Repaid", x.interest_outstanding  AS "Interest Outstanding", x.interest_overdue  AS "Interest Overdue", x.fees  AS "Total Fees", x.fees_repaid AS "Fees Repaid", x.fees_outstanding  AS "Fees Outstanding", x.fees_overdue  AS "Fees Overdue", x.penalties AS "Total Penalties", x.penalties_repaid  AS "Penalties Repaid", x.penalties_outstanding AS "Penalties Outstanding", x.penalties_overdue AS "Penalties Overdue", ( CASE WHEN ${parType} = 1 THEN cast(round((x.principal_overdue * 100) / x.principal_outstanding, 2) AS                                                                                                                                     CHAR) WHEN ${parType} = 2 THEN cast(round(((x.principal_overdue + x.interest_overdue) * 100) / (x.principal_outstanding + x.interest_outstanding), 2) AS                                                                                   CHAR) WHEN ${parType} = 3 THEN cast(round(((x.principal_overdue + x.interest_overdue + x.fees_overdue) * 100) / (x.principal_outstanding + x.interest_outstanding + x.fees_outstanding), 2) AS                                             CHAR) WHEN ${parType} = 4 THEN cast(round(((x.principal_overdue + x.interest_overdue + x.fees_overdue + x.penalties_overdue) * 100) / (x.principal_outstanding + x.interest_outstanding + x.fees_outstanding + x.penalties_overdue), 2) AS CHAR) ELSE ''invalid PAR Type'' end) AS "Portfolio at Risk %" FROM     m_office mo JOIN ( SELECT    lastinstallment.branchid AS branchid, lastinstallment.currency, count(DISTINCT(lastinstallment.clientid))  AS client_count, count(DISTINCT(lastinstallment.loanid))  AS active_loan_count, count(DISTINCT(laa.loan_id) )  AS arrears_loan_count, sum(l.principal_disbursed_derived) AS principal, sum(l.principal_repaid_derived)  AS principal_repaid, sum(l.principal_outstanding_derived) AS principal_outstanding, sum(coalesce(laa.principal_overdue_derived,0)) AS principal_overdue, sum(l.interest_charged_derived)  AS interest, sum(l.interest_repaid_derived) AS interest_repaid, sum(l.interest_outstanding_derived)  AS interest_outstanding, sum(coalesce(laa.interest_overdue_derived,0))  AS interest_overdue, sum(l.fee_charges_charged_derived) AS fees, sum(l.fee_charges_repaid_derived)  AS fees_repaid, sum(l.fee_charges_outstanding_derived) AS fees_outstanding, sum(coalesce(laa.fee_charges_overdue_derived,0)) AS fees_overdue, sum(l.penalty_charges_charged_derived) AS penalties, sum(l.penalty_charges_repaid_derived)  AS penalties_repaid, sum(l.penalty_charges_outstanding_derived) AS penalties_outstanding, sum(coalesce(laa.penalty_charges_overdue_derived,0)) AS penalties_overdue FROM      ( SELECT    l.id AS loanid, l.number_of_repayments, min(r.installment), ounder.id AS branchid, ounder.hierarchy, ounder.name AS branch, coalesce(cur.display_symbol, l.currency_code) AS currency, lo.display_name AS "Loan Officer", c.id  AS clientid, c.account_no  AS "Client Account No", c.display_name  AS "Client", l.account_no  AS "Loan Account No", pl.name AS "Product", f.name  AS fund, l.principal_amount  AS "Loan Amount", l.annual_nominal_interest_rate  AS "Annual Nominal Interest Rate", DATE_TRUNC(''day'', l.disbursedon_date) AS "Disbursed", DATE_TRUNC(''day'', l.expected_maturedon_date)  AS "Expected Matured On" FROM      m_office o JOIN      m_office ounder ON        ounder.hierarchy LIKE concat(o.hierarchy, ''%'') AND       ounder.hierarchy LIKE concat(''${currentUserHierarchy}'', ''%'') JOIN      m_client c ON        c.office_id = ounder.id JOIN      m_loan l ON        l.client_id = c.id JOIN      m_product_loan pl ON        pl.id = l.product_id LEFT JOIN m_staff lo ON        lo.id = l.loan_officer_id LEFT JOIN m_currency cur ON        cur.code = l.currency_code LEFT JOIN m_fund f ON        f.id = l.fund_id LEFT JOIN m_loan_repayment_schedule r ON        r.loan_id = l.id WHERE     o.id = ''${officeId}'' AND       ( l.currency_code = ''${currencyId}'' OR        ''-1'' = ''${currencyId}'') AND       ( l.product_id = ''${loanProductId}'' OR        ''-1'' = ''${loanProductId}'') AND       ( coalesce(l.loan_officer_id, -10) = ${loanOfficerId} OR        ''-1'' = ${loanOfficerId}) AND       ( coalesce(l.fund_id, -10) = ${fundId} OR        -1 = ${fundId}) AND       ( coalesce(l.loanpurpose_cv_id, -10) = ${loanPurposeId} OR        -1 = ${loanPurposeId}) AND       l.loan_status_id = 300 AND       r.completed_derived IS FALSE AND       r.duedate >= CURRENT_DATE GROUP BY  l.id, ounder.id, cur.display_symbol, lo.display_name, c.id, pl.name, f.name HAVING    l.number_of_repayments = min(r.installment)) lastinstallment JOIN      m_loan l ON        l.id = lastinstallment.loanid LEFT JOIN m_loan_arrears_aging laa ON        laa.loan_id = l.id GROUP BY  lastinstallment.branchid, lastinstallment.currency) x ON       x.branchid = mo.id ORDER BY mo.hierarchy, x.currency', 'Individual Client   Report', true, true, false);
INSERT INTO public.stretchy_report VALUES (59, 'Active Loans by Disbursal Period', 'Table', NULL, 'Loan', 'SELECT    Concat(REPEAT(''..'', ((Length(ounder.hierarchy) - Length(REPLACE(ounder.hierarchy, ''.'', '''')) - 1))), ounder.name) AS "Office/Branch", Coalesce(cur.display_symbol, l.currency_code)  AS currency, c.account_no AS "Client Account No", c.display_name AS "Client", l.account_no AS "Loan Account No", pl.name  AS "Product", f.name AS fund, l.principal_amount AS "Loan Principal Amount", l.annual_nominal_interest_rate AS "Annual Nominal Interest Rate", DATE_TRUNC(''day'', l.disbursedon_date)  AS "Disbursed Date", l.total_expected_repayment_derived AS "Total Loan (P+I+F+Pen)", l.total_repayment_derived  AS "Total Repaid (P+I+F+Pen)", lo.display_name  AS "Loan Officer" FROM      m_office o JOIN      m_office ounder ON        ounder.hierarchy LIKE Concat(o.hierarchy, ''%'') AND       ounder.hierarchy LIKE Concat(''${currentUserHierarchy}'', ''%'') JOIN      m_client c ON        c.office_id = ounder.id JOIN      m_loan l ON        l.client_id = c.id JOIN      m_product_loan pl ON        pl.id = l.product_id LEFT JOIN m_staff lo ON        lo.id = l.loan_officer_id LEFT JOIN m_currency cur ON        cur.code = l.currency_code LEFT JOIN m_fund f ON        f.id = l.fund_id LEFT JOIN m_loan_arrears_aging laa ON        laa.loan_id = l.id WHERE     o.id = ''${officeId}'' AND       (l.currency_code = ''${currencyId}'' OR ''-1'' = ''${currencyId}'') AND       (l.product_id = ''${loanProductId}'' OR ''-1'' = ''${loanProductId}'') AND       (Coalesce(l.loan_officer_id, -10) = ${loanOfficerId} OR ''-1'' = ${loanOfficerId}) AND       (coalesce(l.fund_id, -10) = ${fundId} OR -1 = ${fundId}) AND       (coalesce(l.loanpurpose_cv_id, -10) = ${loanPurposeId} OR -1 = ${loanPurposeId}) AND       l.disbursedon_date BETWEEN ''${startDate}'' AND ''${endDate}'' AND       l.loan_status_id = 300 GROUP BY  l.id, ounder.hierarchy, ounder.name, cur.display_symbol, c.account_no, c.display_name, pl.name, f.name, lo.display_name ORDER BY  ounder.hierarchy, l.currency_code, c.account_no, l.account_no', 'Individual Client   Report', true, true, false);
INSERT INTO public.stretchy_report VALUES (61, 'Aging Summary (Arrears in Months)', 'Table', NULL, 'Loan', 'SELECT    Coalesce(periods.currencyname, periods.currency) AS currency, periods.period_no AS "Days In Arrears", coalesce(ars.loanid, 0) AS "No Of Loans", coalesce(ars.principal,0.0) AS "Original Principal", coalesce(ars.interest,0.0) AS "Original Interest", coalesce(ars.prinpaid,0.0) AS "Principal Paid", coalesce(ars.intpaid,0.0) AS "Interest Paid", coalesce(ars.prinoverdue,0.0) AS "Principal Overdue", coalesce(ars.intoverdue,0.0) AS "Interest Overdue" FROM ( SELECT curs.code AS currency, curs.name AS currencyname, pers.* FROM   ( SELECT ''On Schedule'' period_no, 1 pid UNION SELECT ''0 - 30'', 2 UNION SELECT ''30 - 60'', 3 UNION SELECT ''60 - 90'', 4 UNION SELECT ''90 - 180'', 5 UNION SELECT ''180 - 360'', 6 UNION SELECT ''> 360'', 7 ) pers, ( SELECT  DISTINCT ON (moc.code) moc.code, moc.name FROM       m_office mo2 INNER JOIN m_office ounder2 ON         ounder2.hierarchy LIKE concat(mo2.hierarchy, ''%'') AND        ounder2.hierarchy LIKE concat(''${currentUserHierarchy}'', ''%'') INNER JOIN m_client mc2 ON         mc2.office_id=ounder2.id INNER JOIN m_loan ml2 ON         ml2.client_id = mc2.id INNER JOIN m_organisation_currency moc ON         moc.code = ml2.currency_code WHERE      ml2.loan_status_id=300 /* active */ AND        mo2.id=''${officeId}'' AND        ( ml2.currency_code = ''${currencyId}'' OR         ''-1'' = ''${currencyId}'') GROUP BY moc.code, moc.name) curs) periods LEFT JOIN /* table of aging periods per currency with gaps if no applicable loans */ ( SELECT   z.currency, z.arrperiod, count(z.loanid)  AS loanid, sum(z.principal) AS principal, sum(z.interest)  AS interest, sum(z.prinpaid)  AS prinpaid, sum(z.intpaid) AS intpaid, sum(z.prinoverdue) AS prinoverdue, sum(z.intoverdue)  AS intoverdue FROM     ( SELECT x.loanid, x.currency, x.principal, x.interest, x.prinpaid, x.intpaid, x.prinoverdue, x.intoverdue, CASE WHEN extract(day FROM (CURRENT_DATE::TIMESTAMP - MINOVERDUEDATE::TIMESTAMP))<1 THEN ''On Schedule'' WHEN extract(day FROM (CURRENT_DATE::TIMESTAMP - MINOVERDUEDATE::TIMESTAMP))<31 THEN ''0 - 30'' WHEN extract(day FROM (CURRENT_DATE::TIMESTAMP - MINOVERDUEDATE::TIMESTAMP))<61 THEN ''30 - 60'' WHEN extract(day FROM (CURRENT_DATE::TIMESTAMP - MINOVERDUEDATE::TIMESTAMP))<91 THEN ''60 - 90'' WHEN extract(day FROM (CURRENT_DATE::TIMESTAMP - MINOVERDUEDATE::TIMESTAMP))<181 THEN ''90 - 180'' WHEN extract(day FROM (CURRENT_DATE::TIMESTAMP - MINOVERDUEDATE::TIMESTAMP))<361 THEN ''180 - 360'' ELSE ''> 360'' end AS arrperiod FROM   ( SELECT     ml.id  AS loanid, ml.currency_code AS currency, ml.principal_disbursed_derived AS principal, ml.interest_charged_derived  AS interest, ml.principal_repaid_derived  AS prinpaid, ml.interest_repaid_derived AS intpaid, laa.principal_overdue_derived  AS prinoverdue, laa.interest_overdue_derived AS intoverdue, coalesce(laa.overdue_since_date_derived, CURRENT_DATE) AS minoverduedate FROM       m_office mo INNER JOIN m_office ounder ON         ounder.hierarchy LIKE concat(mo.hierarchy, ''%'') AND        ounder.hierarchy LIKE concat(''${currentUserHierarchy}'', ''%'') INNER JOIN m_client mc ON         mc.office_id=ounder.id INNER JOIN m_loan ml ON         ml.client_id = mc.id LEFT JOIN  m_loan_arrears_aging laa ON         laa.loan_id = ml.id WHERE      ml.loan_status_id=300 AND        mo.id=''${officeId}'' AND        ( ml.currency_code = ''${currencyId}'' OR         ''-1'' = ''${currencyId}'') GROUP BY   ml.id, laa.principal_overdue_derived, laa.interest_overdue_derived, laa.overdue_since_date_derived) x ) z GROUP BY z.currency, z.arrperiod ) ars ON        ars.arrperiod=periods.period_no AND       ars.currency = periods.currency ORDER BY  periods.currency, periods.pid', 'Loan amount in arrears by branch', true, true, false);
