INSERT INTO public.stretchy_report VALUES (93, 'Expected Payments By Date - Basic', 'Table', NULL, 'Loan', 'SELECT    ounder.name AS "Office", coalesce(ms.display_name,''-'') AS "Loan Officer", mc.account_no AS "Client Account Number", mc.display_name AS "Name", mp.name AS "Product", ml.account_no AS "Loan Account Number", mr.duedate AS "Due Date", mr.installment AS "Installment", cu.display_symbol AS "Currency", mr.principal_amount - coalesce(mr.principal_completed_derived,0) AS "Principal Due", mr.interest_amount - coalesce(coalesce(mr.interest_completed_derived,mr.interest_waived_derived),0) AS "Interest Due", coalesce(mr.fee_charges_amount,0) - coalesce(coalesce(mr.fee_charges_completed_derived,mr.fee_charges_waived_derived),0) AS "Fees Due", coalesce(mr.penalty_charges_amount,0) - coalesce(coalesce(mr.penalty_charges_completed_derived,mr.penalty_charges_waived_derived),0) AS "Penalty Due", (mr.principal_amount- coalesce(mr.principal_completed_derived,0)) + (mr.interest_amount- coalesce(coalesce(mr.interest_completed_derived,mr.interest_waived_derived),0)) + (coalesce(mr.fee_charges_amount,0)- coalesce(coalesce(mr.fee_charges_completed_derived,mr.fee_charges_waived_derived),0)) + (coalesce(mr.penalty_charges_amount,0)- coalesce(coalesce(mr.penalty_charges_completed_derived,mr.penalty_charges_waived_derived),0)) AS "Total Due", mlaa.total_overdue_derived AS "Total Overdue" FROM      m_office mo JOIN      m_office ounder ON        ounder.hierarchy LIKE concat(mo.hierarchy, ''%'') AND       ounder.hierarchy LIKE concat(''${currentUserHierarchy}'', ''%'') LEFT JOIN m_client mc ON        mc.office_id=ounder.id LEFT JOIN m_loan ml ON        ml.client_id=mc.id AND       ml.loan_status_id=300 LEFT JOIN m_loan_arrears_aging mlaa ON        mlaa.loan_id=ml.id LEFT JOIN m_loan_repayment_schedule mr ON        mr.loan_id=ml.id AND       mr.completed_derived=false LEFT JOIN m_product_loan mp ON        mp.id=ml.product_id LEFT JOIN m_staff ms ON        ms.id=ml.loan_officer_id LEFT JOIN m_currency cu ON        cu.code=ml.currency_code WHERE     mo.id=''${officeId}'' AND       ( coalesce(ml.loan_officer_id, -10) = ${loanOfficerId} OR        ''-1'' = ${loanOfficerId}) AND       mr.duedate BETWEEN ''${startDate}'' AND ''${endDate}'' ORDER BY  ounder.id, mr.duedate, ml.account_no', 'Test', true, true, false);
