INSERT INTO public.stretchy_report VALUES (96, 'GroupSummaryCounts', 'Table', NULL, NULL, 'SELECT    x.* FROM      m_office o,
          m_group g,
          (
                    SELECT    a.activeclients,
                              (b.activeclientloans + c.activegrouploans) AS activeloans,
                              b.activeclientloans,
                              c.activegrouploans,
                              (b.activeclientborrowers + c.activegroupborrowers) AS activeborrowers,
                              b.activeclientborrowers,
                              c.activegroupborrowers,
                              (b.overdueclientloans + c.overduegrouploans) AS overdueloans,
                              b.overdueclientloans,
                              c.overduegrouploans
                    FROM      (
                                     SELECT Count(*) AS activeclients
                                     FROM   m_group topgroup
                                     JOIN   m_group g
                                     ON     g.hierarchy LIKE Concat(topgroup.hierarchy, ''%'')
                                     JOIN   m_group_client gc
                                     ON     gc.group_id = g.id
                                     JOIN   m_client c
                                     ON     c.id = gc.client_id
                                     WHERE  topgroup.id = ${groupId}
                                     AND    c.status_enum = 300) a,
                              (
                                     SELECT count(*) AS activeclientloans,
                                            count(DISTINCT(l.client_id)) AS activeclientborrowers,
                                            coalesce(sum(
                                            CASE
                                                   WHEN laa.loan_id IS NOT NULL THEN 1
                                                   ELSE 0
                                            end),
                                            0) AS overdueclientloans
                    FROM      m_group topgroup
                    JOIN      m_group g
                    ON        g.hierarchy LIKE concat(topgroup.hierarchy, ''%'')
                    JOIN      m_loan l
                    ON        l.group_id = g.id
                    AND       l.client_id IS NOT NULL
                    LEFT JOIN m_loan_arrears_aging laa
                    ON        laa.loan_id = l.id
                    WHERE     topgroup.id = ${groupId}
                    AND       l.loan_status_id = 300) b,
          (
                 SELECT count(*)  AS activegrouploans,
                        count(DISTINCT(l.group_id)) AS activegroupborrowers,
                        coalesce(sum(
                        CASE
                               WHEN laa.loan_id IS NOT NULL THEN 1
                               ELSE 0
                        end),
                        0) AS overduegrouploans
FROM      m_group topgroup JOIN      m_group g ON        g.hierarchy LIKE concat(topgroup.hierarchy, ''%'') JOIN      m_loan l ON        l.group_id = g.id AND       l.client_id IS NULL LEFT JOIN m_loan_arrears_aging laa ON        laa.loan_id = l.id WHERE     topgroup.id = ${groupId} AND       l.loan_status_id = 300) c ) x WHERE g.id = ${groupId} AND o.id = g.office_id AND o.hierarchy LIKE concat(''${currentUserHierarchy}'', ''%'')
', 'Utility query for getting group summary count details for a group_id', true, false, false);
INSERT INTO public.stretchy_report VALUES (97, 'GroupSummaryAmounts', 'Table', NULL, NULL, '
SELECT    Coalesce(cur.display_symbol, l.currency_code)  AS currency,
          Coalesce(Sum(l.principal_disbursed_derived),0) AS totaldisbursedamount,
          Coalesce(Sum(l.principal_outstanding_derived),0) AS totalloanoutstandingamount,
          Count(laa.loan_id) AS overdueloans,
          Coalesce(Sum(laa.total_overdue_derived), 0)  AS totalloanoverdueamount
FROM      m_group topgroup JOIN      m_office o ON        o.id = topgroup.office_id AND       o.hierarchy LIKE Concat(''${currentUserHierarchy}'', ''%'') JOIN      m_group g ON        g.hierarchy LIKE Concat(topgroup.hierarchy, ''%'') JOIN      m_loan l ON        l.group_id = g.id LEFT JOIN m_loan_arrears_aging laa ON        laa.loan_id = l.id LEFT JOIN m_currency cur ON        cur.code = l.currency_code WHERE     topgroup.id = ${groupId} AND       l.disbursedon_date IS NOT NULL GROUP BY  l.currency_code,
          cur.display_symbol
', 'Utility query for getting group summary currency amount details for a group_id', true, false, false);
INSERT INTO public.stretchy_report VALUES (106, 'TxnRunningBalances', 'Table', NULL, 'Transaction', 'select DATE ${startDate} AS "Transaction Date", ''Opening Balance'' AS "Transaction Type", null AS "Office", null AS "Loan Officer", null AS "Loan Account No", null AS "Loan Product", null AS "Currency", null AS "Client Account No", null AS "Client", null AS "Principal", null AS "Interest", COALESCE(round(sum(CASE WHEN txn.transaction_type_enum  = 1 /* disbursement */ THEN COALESCE(txn.interest_portion_derived, 0.00) ELSE 0 END), 2), 0.00) AS "Outstanding Principal", COALESCE(round(sum(CASE WHEN txn.transaction_type_enum in (2, 5, 8) /* repayment, repayment at disbursal, recovery repayment */ THEN COALESCE(txn.interest_portion_derived, 0.00) ELSE 0 END), 2), 0.00) AS "Interest Income", COALESCE(round(sum(CASE WHEN txn.transaction_type_enum = 6 THEN COALESCE(txn.principal_portion_derived, 0.00) ELSE 0 END), 2), 0.00) AS "Principal Write Off" from m_office o join m_office ounder on ounder.hierarchy like concat(o.hierarchy, ''%'') and ounder.hierarchy like concat(''${currentUserHierarchy}'', ''%'') join m_client c on c.office_id = ounder.id join m_loan l on l.client_id = c.id join m_product_loan lp on lp.id = l.product_id join m_loan_transaction txn on txn.loan_id = l.id left join m_currency cur on cur.code = l.currency_code where txn.is_reversed = false and txn.transaction_type_enum not in (10, 11) and o.id = ''${officeId}'' and txn.transaction_date < DATE ${startDate} union all select txn.transaction_date AS "Transaction Date", cast(COALESCE(re.enum_message_property, concat(''Unknown Transaction Type Value:'', '' '', txn.transaction_type_enum)) as char) AS "Transaction Type", ounder.name AS "Office", lo.display_name AS "Loan Officer", l.account_no AS "Loan Account No", lp.name AS "Loan Product", COALESCE(cur.display_symbol, l.currency_code) AS "Currency", c.account_no AS "Client Account No", c.display_name AS "Client", COALESCE(txn.principal_portion_derived, 0.00) AS "Principal", COALESCE(txn.interest_portion_derived, 0.00) AS "Interest", COALESCE(round(sum(CASE WHEN txn.transaction_type_enum = 1 /* disbursement */ THEN COALESCE(txn.amount, 0.00) ELSE -1 * COALESCE(txn.principal_portion_derived, 0.00) END), 2), 0.00) AS "Outstanding Principal", COALESCE(round(sum(CASE WHEN txn.transaction_type_enum in (2, 5, 8) /* repayment, repayment at disbursal, recovery repayment */ THEN COALESCE(txn.interest_portion_derived, 0.00) ELSE 0 END), 2), 0.00) AS "Interest Income", COALESCE(round(sum(CASE WHEN txn.transaction_type_enum = 6 THEN COALESCE(txn.principal_portion_derived, 0.00) ELSE 0 END), 2), 0.00) AS "Principal Write Off" from m_office o join m_office ounder on ounder.hierarchy like concat(o.hierarchy, ''%'') and ounder.hierarchy like concat(''${currentUserHierarchy}'', ''%'') join m_client c on c.office_id = ounder.id join m_loan l on l.client_id = c.id left join m_staff lo on lo.id = l.loan_officer_id join m_product_loan lp on lp.id = l.product_id join m_loan_transaction txn on txn.loan_id = l.id left join m_currency cur on cur.code = l.currency_code left join r_enum_value re on re.enum_name = ''transaction_type_enum'' AND re.enum_id = txn.transaction_type_enum where txn.is_reversed = false and txn.transaction_type_enum not in (10, 11) and (COALESCE(l.loan_officer_id, -10) = 9 or ''-1'' = 9) and o.id = ''${officeId}'' and txn.transaction_date >= DATE ${startDate} and txn.transaction_date <= DATE ${endDate} group by txn.id, ounder.id, lo.id, l.id, lp.id, cur.id, c.id, re.enum_message_property', 'Running Balance Txn report for Individual Lending.
Suitable for small MFI''s.  Larger could use it using the branch or other parameters.
Basically, suck it and see if its quick enough for you out-of-te box or whether it needs performance work in your situation.
', false, false, false);
INSERT INTO public.stretchy_report VALUES (107, 'FieldAgentStats', 'Table', NULL, 'Quipo', 'select COALESCE(cur.display_symbol, l.currency_code) as Currency, /*This query will return more than one entry if more than one currency is used */ count(distinct(c.id)) as activeClients, count(*) as activeLoans, sum(l.principal_disbursed_derived) as disbursedAmount, sum(l.principal_outstanding_derived) as loanOutstandingAmount, round((sum(l.principal_outstanding_derived) * 100) / sum(l.principal_disbursed_derived),2) as loanOutstandingPC, sum(COALESCE(lpa.principal_in_advance_derived,0.0)) as LoanPaidInAdvance, sum( CASE WHEN (CURRENT_DATE - 28 * INTERVAL ''1 day'') > COALESCE(laa.overdue_since_date_derived, CURRENT_DATE) THEN l.principal_outstanding_derived ELSE 0 END) as portfolioAtRisk, round((sum( CASE WHEN (CURRENT_DATE - 28 * INTERVAL ''1 day'') > COALESCE(laa.overdue_since_date_derived, CURRENT_DATE) THEN l.principal_outstanding_derived ELSE 0 END) * 100) / sum(l.principal_outstanding_derived), 2) as portfolioAtRiskPC, count(distinct( CASE WHEN (CURRENT_DATE - 28 * INTERVAL ''1 day'') > COALESCE(laa.overdue_since_date_derived, CURRENT_DATE) THEN c.id ELSE null END)) as clientsInDefault, round((count(distinct( CASE WHEN (CURRENT_DATE - 28 * INTERVAL ''1 day'') > COALESCE(laa.overdue_since_date_derived, CURRENT_DATE) THEN c.id ELSE null END))) * 100 / count(distinct(c.id)),2) as clientsInDefaultPC, sum(l.principal_disbursed_derived) / count(*) as averageLoanAmount from m_staff fa join m_office o on o.id = fa.office_id AND o.hierarchy like concat(''${currentUserHierarchy}'', ''%'') join m_group pgm on pgm.staff_id = fa.id join m_loan l on l.group_id = pgm.id and l.client_id is not null left join m_currency cur on cur.code = l.currency_code left join m_loan_arrears_aging laa on laa.loan_id = l.id left join m_loan_paid_in_advance lpa on lpa.loan_id = l.id join m_client c on c.id = l.client_id where fa.id = ${staffId} and l.loan_status_id = 300 group by l.currency_code, cur.id', 'Field Agent Statistics', false, false, false);
INSERT INTO public.stretchy_report VALUES (108, 'FieldAgentPrograms', 'Table', NULL, 'Quipo', 'select pgm.id, pgm.display_name as name, sts.enum_message_property as status  from m_group pgm  join m_office o on o.id = pgm.office_id AND o.hierarchy like concat(''${currentUserHierarchy}'', ''%'') left join r_enum_value sts on sts.enum_name = ''status_enum'' and sts.enum_id = pgm.status_enum  where pgm.staff_id = ${staffId}', 'List of Field Agent Programs', false, false, false);
INSERT INTO public.stretchy_report VALUES (109, 'ProgramDetails', 'Table', NULL, 'Quipo', 'select l.id as loanId, l.account_no as loanAccountNo, c.id as clientId, c.account_no as clientAccountNo, pgm.display_name as programName,  (select count(*) from m_loan cy where cy.group_id = pgm.id and cy.client_id =c.id and cy.disbursedon_date <= l.disbursedon_date) as loanCycleNo,  c.display_name as clientDisplayName, COALESCE(cur.display_symbol, l.currency_code) as Currency, COALESCE(l.principal_repaid_derived,0.0) as loanRepaidAmount, COALESCE(l.principal_outstanding_derived, 0.0) as loanOutstandingAmount, COALESCE(lpa.principal_in_advance_derived,0.0) as LoanPaidInAdvance,  COALESCE(laa.principal_overdue_derived, 0.0) as loanInArrearsAmount, CASE WHEN COALESCE(laa.principal_overdue_derived, 0.00) > 0 THEN ''Yes'' ELSE ''No'' END as inDefault,  CASE WHEN (CURRENT_DATE - 28 * INTERVAL ''1 day'') > COALESCE(laa.overdue_since_date_derived, CURRENT_DATE) THEN l.principal_outstanding_derived ELSE 0 END as portfolioAtRisk   from m_group pgm  join m_office o on o.id = pgm.office_id AND o.hierarchy like concat(''${currentUserHierarchy}'', ''%'')  join m_loan l on l.group_id = pgm.id and l.client_id is not null  left join m_currency cur on cur.code = l.currency_code  join m_client c on c.id = l.client_id left join m_loan_arrears_aging laa on laa.loan_id = l.id  left join m_loan_paid_in_advance lpa on lpa.loan_id = l.id  where pgm.id = ${programId}  and l.loan_status_id = 300 order by c.display_name, l.account_no', 'List of Loans in a Program', false, false, false);
INSERT INTO public.stretchy_report VALUES (110, 'ChildrenStaffList', 'Table', NULL, 'Quipo', 'select s.id, s.display_name, s.firstname, s.lastname, s.organisational_role_enum,
s.organisational_role_parent_staff_id,
sp.display_name AS "organisational_role_parent_staff_display_name"
from m_staff s
join m_staff sp on s.organisational_role_parent_staff_id = sp.id
where s.organisational_role_parent_staff_id = ${staffId}', 'Get Next Level Down Staff', false, false, false);
INSERT INTO public.stretchy_report VALUES (111, 'CoordinatorStats', 'Table', NULL, 'Quipo', 'select COALESCE(cur.display_symbol, l.currency_code) as Currency, /*This query will return more than one entry if more than one currency is used */ count(distinct(c.id)) as activeClients, count(*) as activeLoans, sum(l.principal_disbursed_derived) as disbursedAmount, sum(l.principal_outstanding_derived) as loanOutstandingAmount, round((sum(l.principal_outstanding_derived) * 100) / sum(l.principal_disbursed_derived),2) as loanOutstandingPC, sum(COALESCE(lpa.principal_in_advance_derived,0.0)) as LoanPaidInAdvance, sum( CASE WHEN (CURRENT_DATE - 28 * INTERVAL ''1 day'') > COALESCE(laa.overdue_since_date_derived, CURRENT_DATE) THEN l.principal_outstanding_derived ELSE 0 END) as portfolioAtRisk, round((sum( CASE WHEN (CURRENT_DATE - 28 * INTERVAL ''1 day'') > COALESCE(laa.overdue_since_date_derived, CURRENT_DATE) THEN l.principal_outstanding_derived ELSE 0 END) * 100) / sum(l.principal_outstanding_derived), 2) as portfolioAtRiskPC, count(distinct( CASE WHEN (CURRENT_DATE - 28 * INTERVAL ''1 day'') > COALESCE(laa.overdue_since_date_derived, CURRENT_DATE) THEN c.id ELSE null END)) as clientsInDefault, round((count(distinct( CASE WHEN (CURRENT_DATE - 28 * INTERVAL ''1 day'') > COALESCE(laa.overdue_since_date_derived, CURRENT_DATE) THEN c.id ELSE null END))) * 100 / count(distinct(c.id)),2) as clientsInDefaultPC, sum(l.principal_disbursed_derived) / count(*) as averageLoanAmount from m_staff coord join m_staff fa on fa.organisational_role_parent_staff_id = coord.id join m_office o on o.id = fa.office_id AND o.hierarchy like concat(''${currentUserHierarchy}'', ''%'') join m_group pgm on pgm.staff_id = fa.id join m_loan l on l.group_id = pgm.id and l.client_id is not null left join m_currency cur on cur.code = l.currency_code left join m_loan_arrears_aging laa on laa.loan_id = l.id left join m_loan_paid_in_advance lpa on lpa.loan_id = l.id join m_client c on c.id = l.client_id where coord.id = ${staffId} and l.loan_status_id = 300 group by l.currency_code, cur.id', 'Coordinator Statistics', false, false, false);
INSERT INTO public.stretchy_report VALUES (112, 'BranchManagerStats', 'Table', NULL, 'Quipo', 'SELECT    Coalesce(cur.display_symbol, l.currency_code)  AS currency, Count(DISTINCT(c.id))  AS activeclients, Count(*) AS activeloans, Sum(l.principal_disbursed_derived) AS disbursedamount, Sum(l.principal_outstanding_derived) AS loanoutstandingamount, Round((Sum(l.principal_outstanding_derived) * 100) / Sum(l.principal_disbursed_derived),2) AS loanoutstandingpc, Sum(Coalesce(lpa.principal_in_advance_derived,0.0))  AS loanpaidinadvance, sum( CASE WHEN ( CURRENT_DATE - 28 * INTERVAL ''1 day'') > coalesce(laa.overdue_since_date_derived, CURRENT_DATE) THEN l.principal_outstanding_derived ELSE 0 end) AS portfolioatrisk, round((sum( CASE WHEN ( CURRENT_DATE - 28 * INTERVAL ''1 day'' ) > coalesce(laa.overdue_since_date_derived, CURRENT_DATE) THEN l.principal_outstanding_derived ELSE 0 end) * 100) / sum(l.principal_outstanding_derived), 2) AS portfolioatriskpc, count(DISTINCT( CASE WHEN ( CURRENT_DATE - 28 * INTERVAL ''1 day'' ) > coalesce(laa.overdue_since_date_derived, CURRENT_DATE) THEN c.id ELSE NULL end)) AS clientsindefault, round((count(DISTINCT( CASE WHEN ( CURRENT_DATE - 28 * INTERVAL ''1 day'' ) > coalesce(laa.overdue_since_date_derived, CURRENT_DATE) THEN c.id ELSE NULL end)) * 100) / count(DISTINCT(c.id)), 2)  AS clientsindefaultpc, (sum(l.principal_disbursed_derived) / count(*)) AS averageloanamount FROM      m_staff bm JOIN      m_staff coord ON        coord.organisational_role_parent_staff_id = bm.id JOIN      m_staff fa ON        fa.organisational_role_parent_staff_id = coord.id JOIN      m_office o ON        o.id = fa.office_id AND       o.hierarchy LIKE concat(''${currentUserHierarchy}'', ''%'') JOIN      m_group pgm ON        pgm.staff_id = fa.id JOIN      m_loan l ON        l.group_id = pgm.id AND       l.client_id IS NOT NULL LEFT JOIN m_currency cur ON        cur.code = l.currency_code LEFT JOIN m_loan_arrears_aging laa ON        laa.loan_id = l.id LEFT JOIN m_loan_paid_in_advance lpa ON        lpa.loan_id = l.id JOIN      m_client c ON        c.id = l.client_id WHERE     bm.id = ${staffId} AND       l.loan_status_id = 300 GROUP BY  l.currency_code, cur.display_symbol', 'Branch Manager Statistics', false, false, false);
INSERT INTO public.stretchy_report VALUES (114, 'ProgramStats', 'Table', NULL, 'Quipo', 'select COALESCE(cur.display_symbol, l.currency_code) as Currency, /*This query will return more than one entry if more than one currency is used */ count(distinct(c.id)) as activeClients, count(*) as activeLoans, sum(l.principal_disbursed_derived) as disbursedAmount, sum(l.principal_outstanding_derived) as loanOutstandingAmount, round((sum(l.principal_outstanding_derived) * 100) / sum(l.principal_disbursed_derived),2) as loanOutstandingPC, sum(COALESCE(lpa.principal_in_advance_derived,0.0)) as LoanPaidInAdvance, sum( CASE WHEN (CURRENT_DATE - 28 * INTERVAL ''1 day'') > COALESCE(laa.overdue_since_date_derived, CURRENT_DATE) THEN l.principal_outstanding_derived ELSE 0 END) as portfolioAtRisk, round((sum( CASE WHEN (CURRENT_DATE - 28 * INTERVAL ''1 day'') > COALESCE(laa.overdue_since_date_derived, CURRENT_DATE) THEN l.principal_outstanding_derived ELSE 0 END) * 100) / sum(l.principal_outstanding_derived), 2) as portfolioAtRiskPC, count(distinct( CASE WHEN (CURRENT_DATE - 28 * INTERVAL ''1 day'') > COALESCE(laa.overdue_since_date_derived, CURRENT_DATE) THEN c.id ELSE null END)) as clientsInDefault, round((count(distinct( CASE WHEN (CURRENT_DATE - 28 * INTERVAL ''1 day'') > COALESCE(laa.overdue_since_date_derived, CURRENT_DATE) THEN c.id ELSE null END))) * 100 / count(distinct(c.id)),2) as clientsInDefaultPC, sum(l.principal_disbursed_derived) / count(*) as averageLoanAmount from m_group pgm join m_office o on o.id = pgm.office_id AND o.hierarchy like concat(''${currentUserHierarchy}'', ''%'') join m_loan l on l.group_id = pgm.id and l.client_id is not null left join m_currency cur on cur.code = l.currency_code left join m_loan_arrears_aging laa on laa.loan_id = l.id left join m_loan_paid_in_advance lpa on lpa.loan_id = l.id join m_client c on c.id = l.client_id where pgm.id = ${programId} and l.loan_status_id = 300 group  by l.currency_code, cur.id', 'Program Statistics', false, false, false);
INSERT INTO public.stretchy_report VALUES (115, 'ClientSummary ', 'Table', NULL, NULL, 'SELECT x.* FROM m_client c, m_office o, (SELECT a.loanCycle, a.activeLoans, b.lastLoanAmount, d.activeSavings, d.totalSavings FROM (SELECT COALESCE(MAX(l.loan_counter),0) AS loanCycle, COUNT(l.id) AS activeLoans FROM m_loan l WHERE l.loan_status_id=300 AND l.client_id=${clientId}) a, (SELECT count(l.id), COALESCE(l.principal_amount,0) AS lastLoanAmount FROM m_loan l WHERE l.client_id=${clientId} AND l.disbursedon_date = (SELECT COALESCE(MAX(disbursedon_date),NOW()) FROM m_loan where client_id=${clientId} and loan_status_id=300) group by l.principal_amount) b, (SELECT COUNT(s.id) AS activeSavings, COALESCE(SUM(s.account_balance_derived),0) AS totalSavings FROM m_savings_account s WHERE s.status_enum=300 AND s.client_id=${clientId}) d) x WHERE c.id=${clientId} AND o.id = c.office_id AND o.hierarchy LIKE CONCAT(''${currentUserHierarchy}'', ''%'')', 'Utility query for getting the client summary details', true, false, false);
INSERT INTO public.stretchy_report VALUES (116, 'LoanCyclePerProduct', 'Table', NULL, NULL, 'SELECT lp.name AS "productName", MAX(l.loan_product_counter) AS "loanProductCycle" FROM m_loan l JOIN m_product_loan lp ON l.product_id=lp.id WHERE lp.include_in_borrower_cycle=true AND l.loan_product_counter IS NOT NULL AND l.client_id=${clientId} GROUP BY lp.id', 'Utility query for getting the client loan cycle details', true, false, false);
INSERT INTO public.stretchy_report VALUES (117, 'GroupSavingSummary', 'Table', NULL, NULL, 'select COALESCE(cur.display_symbol, sa.currency_code) as currency, count(sa.id) as totalSavingAccounts, COALESCE(sum(sa.account_balance_derived),0) as totalSavings from m_group topgroup join m_office o on o.id = topgroup.office_id and o.hierarchy like concat(''${currentUserHierarchy}'', ''%'') join m_group g on g.hierarchy like concat(topgroup.hierarchy, ''%'') join m_savings_account sa on sa.group_id = g.id left join m_currency cur on cur.code = sa.currency_code where topgroup.id = ${groupId} and sa.activatedon_date is not null group by sa.currency_code, cur.id', 'Utility query for getting group or center saving summary details for a group_id', true, false, false);
