INSERT INTO public.stretchy_report VALUES (190, 'Loan Approved - Email', 'Email', 'Triggered', NULL, 'select  ml.id as loanId,  COALESCE(mc.id,mc2.id) as id,  COALESCE(mc.firstname,mc2.firstname) as firstname,   COALESCE(mc.middlename,mc2.middlename,(\''\'')) as middlename, COALESCE(mc.lastname,mc2.lastname) as lastname,   COALESCE(mc.display_name,mc2.display_name) as display_name, COALESCE(mc.status_enum,mc2.status_enum) as status_enum,  COALESCE(mc.mobile_no,mc2.mobile_no) as mobile_no, COALESCE(mg.office_id,mc2.office_id) as office_id, COALESCE(mg.staff_id,mc2.staff_id) as staff_id,   mg.id as group_id, mg.display_name as group_name, COALESCE(mc.email_address,mc2.email_address) as emailAddress from m_loan ml left join m_group mg on mg.id = ml.group_id   left join m_group_client mgc on mgc.group_id = mg.id  left join m_client mc on mc.id = mgc.client_id   left join m_client mc2 on mc2.id = ml.client_id WHERE (mc.status_enum = 300 or mc2.status_enum = 300) and (mc.email_address is not null or mc2.email_address is not null) and ml.id = ${loanId}', 'Loan and client data of approved loan', false, true, false);
INSERT INTO public.stretchy_report VALUES (191, 'Loan Rejected - Email', 'Email', 'Triggered', NULL, 'select  ml.id as loanId,  COALESCE(mc.id,mc2.id) as id,  COALESCE(mc.firstname,mc2.firstname) as firstname,   COALESCE(mc.middlename,mc2.middlename,(\''\'')) as middlename, COALESCE(mc.lastname,mc2.lastname) as lastname,   COALESCE(mc.display_name,mc2.display_name) as display_name, COALESCE(mc.status_enum,mc2.status_enum) as status_enum,  COALESCE(mc.mobile_no,mc2.mobile_no) as mobile_no, COALESCE(mg.office_id,mc2.office_id) as office_id, COALESCE(mg.staff_id,mc2.staff_id) as staff_id,   mg.id as group_id, mg.display_name as group_name, COALESCE(mc.email_address,mc2.email_address) as emailAddress from m_loan ml left join m_group mg on mg.id = ml.group_id   left join m_group_client mgc on mgc.group_id = mg.id  left join m_client mc on mc.id = mgc.client_id   left join m_client mc2 on mc2.id = ml.client_id WHERE (mc.status_enum = 300 or mc2.status_enum = 300) and (mc.email_address is not null or mc2.email_address is not null) and ml.id = ${loanId}', 'Loan and client data of rejected loan', false, true, false);
INSERT INTO public.stretchy_report VALUES (192, 'Loan Repayment - Email', 'Email', 'Triggered', NULL, 'select  ml.id as loanId,  COALESCE(mc.id,mc2.id) as id,  COALESCE(mc.firstname,mc2.firstname) as firstname,   COALESCE(mc.middlename,mc2.middlename,(\''\'')) as middlename, COALESCE(mc.lastname,mc2.lastname) as lastname,   COALESCE(mc.display_name,mc2.display_name) as display_name,  COALESCE(mc.status_enum,mc2.status_enum) as status_enum,   COALESCE(mc.mobile_no,mc2.mobile_no) as mobile_no, COALESCE(mg.office_id,mc2.office_id) as office_id, COALESCE(mg.staff_id,mc2.staff_id) as staff_id,  mg.id as group_id, mg.display_name as group_name, COALESCE(mc.email_address,mc2.email_address) as emailAddress, lt.amount as repaymentAmount   from m_loan_transaction lt join m_loan ml on ml.id=lt.loan_id left join m_group mg on mg.id = ml.group_id  left join m_group_client mgc on mgc.group_id = mg.id   left join m_client mc on mc.id = mgc.client_id  left join m_client mc2 on mc2.id = ml.client_id  WHERE (mc.status_enum = 300 or mc2.status_enum = 300) and (mc.email_address is not null or mc2.email_address is not null) and ml.id = ${loanId} and lt.id = ${loanTransactionId} ', 'Loan and client data of loan repayment', false, true, false);
INSERT INTO public.stretchy_report VALUES (194, 'GeneralLedgerReport Table', 'Table', NULL, 'Accounting', 'select details.edate entry_date, sum(details.debit_amount) debit_amount, sum(details.credit_amount) credit_amount, details.description, coalesce(opb.openingbalance, 0) openingbalance, case when details.manual_entry then cast(details.id as text) else cast(''system'' as text) end transtype, case when actype in (1, 5) then ( sum(details.debit_amount) - sum(details.credit_amount) ) else ( sum(details.credit_amount) - sum(details.debit_amount) ) end as cumulative_sum from ( select a.account_id acid1, concat(gl.gl_code, ''-'', gl.name) as report_header, gl.classification_enum actype, gl.gl_code as reportid, j1.entry_date edate, concat(gl1.gl_code, ''-'', gl1.name) as account_name, case when j1.type_enum = 1 then j1.amount else 0 end as debit_amount, case when j1.type_enum = 2 then j1.amount else 0 end as credit_amount, j1.id, j1.office_id, j1.transaction_id, j1.type_enum, j1.office_running_balance as aftertxn, j1.description as description, j1.transaction_id as transactionid, a.manual_entry from acc_gl_journal_entry j1 inner join ( select distinct je.transaction_id tid, je.account_id, je.manual_entry from m_office o left join m_office ounder on ounder.hierarchy like concat(o.hierarchy, ''%'') inner join acc_gl_journal_entry je on je.office_id = ounder.id where je.account_id = cast(''${GLAccountNO}'' as BIGINT) and o.id = ''${officeId}'' and je.entry_date between ''${startDate}'' and ''${endDate}'' ) a on a.tid = j1.transaction_id and j1.account_id <> cast(''${GLAccountNO}'' as BIGINT) left join acc_gl_account gl on gl.id = a.account_id left join acc_gl_account gl1 on gl1.id = j1.account_id order by j1.entry_date, j1.id ) details left join ( select je.account_id acid2, case when aga1.classification_enum in (1, 5) then (( sum(case when je.type_enum = 2 then coalesce(je.amount, 0) else 0 end)) - sum(case when je.type_enum = 1 then coalesce(je.amount, 0) else 0 end)) else( sum(case when je.type_enum = 1 then coalesce(je.amount, 0) else 0 end) - sum(case when je.type_enum = 2 then coalesce(je.amount, 0) else 0 end)) end as openingbalance from m_office o left join m_office ounder on ounder.hierarchy like concat(o.hierarchy, ''%'') left join acc_gl_journal_entry je on je.office_id = ounder.id left join acc_gl_account aga1 on aga1.id = je.account_id where je.entry_date <= date(''${startDate}'')- interval ''3 day'' and je.office_running_balance is not null and (o.id = ''${officeId}'') and je.account_id = cast(''${GLAccountNO}'' as BIGINT) group by je.account_id, aga1.classification_enum ) opb on opb.acid2 = details.acid1 left join ( select name branchname from m_office mo where mo.id = 1 ) branch on details.office_id = ''${officeId}'' group by details.edate, details.acid1, details.report_header, details.reportid, details.account_name, branch.branchname, transtype, details.description, openingbalance, details.actype', NULL, false, true, false);
INSERT INTO public.stretchy_report VALUES (195, 'Income Statement Table', 'Table', NULL, 'Accounting', '( select * from ( select debits.glcode as "glcode", debits.name as "name", ''Expense'' as IncomeOrExpense, ( coalesce(debits.debitamount, 0) - coalesce(credits.creditamount, 0) ) as "balance" from ( select acc_gl_account.gl_code as "glcode", name, sum(amount) as "debitamount" from acc_gl_journal_entry, acc_gl_account where acc_gl_account.id = acc_gl_journal_entry.account_id and acc_gl_journal_entry.type_enum = 2 and acc_gl_account.classification_enum in (5) and acc_gl_journal_entry.entry_date between ''${startDate}'' and ''${endDate}'' and ( acc_gl_journal_entry.office_id = ''${officeId}'' or ''${officeId}'' = 1 ) group by gl_code,acc_gl_account.name order by glcode ) debits LEFT OUTER JOIN ( select acc_gl_account.gl_code as "glcode", name, sum(amount) as "creditamount" from acc_gl_journal_entry, acc_gl_account where acc_gl_account.id = acc_gl_journal_entry.account_id and acc_gl_journal_entry.type_enum = 1 and acc_gl_account.classification_enum in (5) and acc_gl_journal_entry.entry_date between ''${startDate}'' and ''${endDate}'' and ( acc_gl_journal_entry.office_id = ''${officeId}'' or ''${officeId}'' = 1 ) group by gl_code,acc_gl_account.name ) credits on debits.glcode = credits.glcode union select credits.glcode as "glcode", credits.name as "name", ''Expense'' as IncomeOrExpense, ( coalesce(debits.debitamount, 0) - coalesce(credits.creditamount, 0) ) as "balance" from ( select acc_gl_account.gl_code as "glcode", name, sum(amount) as "debitamount" from acc_gl_journal_entry, acc_gl_account where acc_gl_account.id = acc_gl_journal_entry.account_id and acc_gl_journal_entry.type_enum = 2 and acc_gl_account.classification_enum in (5) and acc_gl_journal_entry.entry_date between ''${startDate}'' and ''${endDate}'' and ( acc_gl_journal_entry.office_id = ''${officeId}'' or ''${officeId}'' = 1 ) group by gl_code , acc_gl_account.name order by glcode ) debits RIGHT OUTER JOIN ( select acc_gl_account.gl_code as "glcode", name as "name", sum(amount) as "creditamount" from acc_gl_journal_entry, acc_gl_account where acc_gl_account.id = acc_gl_journal_entry.account_id and acc_gl_journal_entry.type_enum = 1 and acc_gl_account.classification_enum in (5) and acc_gl_journal_entry.entry_date between ''${startDate}'' and ''${endDate}'' and ( acc_gl_journal_entry.office_id = ''${officeId}'' or ''${officeId}'' = 1 ) group by gl_code , acc_gl_account.name order by glcode ) credits on debits.glcode = credits.glcode ) as fullouterjoinresult order by glcode ) UNION ( select * from ( select debits.glcode as "glcode", debits.name as "name", ''Income'' as IncomeOrExpense, ( coalesce(credits.creditamount, 0) - coalesce(debits.debitamount, 0) ) as "balance" from ( select acc_gl_account.gl_code as "glcode", name, sum(amount) as "debitamount" from acc_gl_journal_entry, acc_gl_account where acc_gl_account.id = acc_gl_journal_entry.account_id and acc_gl_journal_entry.type_enum = 2 and acc_gl_account.classification_enum in (4) and acc_gl_journal_entry.entry_date between ''${startDate}'' and ''${endDate}'' and ( acc_gl_journal_entry.office_id = ''${officeId}'' or ''${officeId}'' = 1 ) group by glcode, acc_gl_account.name order by glcode ) debits LEFT OUTER JOIN ( select acc_gl_account.gl_code as "glcode", name, sum(amount) as "creditamount" from acc_gl_journal_entry, acc_gl_account where acc_gl_account.id = acc_gl_journal_entry.account_id and acc_gl_journal_entry.type_enum = 1 and acc_gl_account.classification_enum in (4) and acc_gl_journal_entry.entry_date between ''${startDate}'' and ''${endDate}'' and ( acc_gl_journal_entry.office_id = ''${officeId}'' or ''${officeId}'' = 1 ) group by glcode , acc_gl_account.name order by glcode ) credits on debits.glcode = credits.glcode union select credits.glcode as "glcode", credits.name as "name", ''Income'' as IncomeOrExpense, ( coalesce(credits.creditamount, 0) - coalesce(debits.debitamount, 0) ) as "balance" from ( select acc_gl_account.gl_code as "glcode", name, sum(amount) as "debitamount" from acc_gl_journal_entry, acc_gl_account where acc_gl_account.id = acc_gl_journal_entry.account_id and acc_gl_journal_entry.type_enum = 2 and acc_gl_account.classification_enum in (4) and acc_gl_journal_entry.entry_date between ''${startDate}'' and ''${endDate}'' and ( acc_gl_journal_entry.office_id = ''${officeId}'' or ''${officeId}'' = 1 ) group by glcode ,acc_gl_account.name order by glcode ) debits RIGHT OUTER JOIN ( select acc_gl_account.gl_code as glcode, name as "name", sum(amount) as creditamount from acc_gl_journal_entry, acc_gl_account where acc_gl_account.id = acc_gl_journal_entry.account_id and acc_gl_journal_entry.type_enum = 1 and acc_gl_account.classification_enum in (4) and acc_gl_journal_entry.entry_date between ''${startDate}'' and ''${endDate}'' and ( acc_gl_journal_entry.office_id = ''${officeId}'' or ''${officeId}'' = 1 ) group by glcode ,acc_gl_account.name order by glcode ) credits on debits.glcode = credits.glcode ) as fullouterjoinresult order by glcode )', 'Profit and Loss Statement', true, true, false);
INSERT INTO public.stretchy_report VALUES (196, 'Balance Sheet Table', 'Table', NULL, 'Accounting', ' ( select debits.glcode as glcode, debits.name as "name", ''Assets'' as BalanceType, ( coalesce(debits.debitamount, 0) - coalesce(credits.creditamount, 0) ) as balance from ( select acc_gl_account.gl_code as glcode, name, sum(amount) as debitamount from acc_gl_journal_entry, acc_gl_account where acc_gl_account.id = acc_gl_journal_entry.account_id and acc_gl_journal_entry.type_enum = 2 and acc_gl_account.classification_enum in (1) and acc_gl_journal_entry.entry_date <= ''${endDate}'' and ( acc_gl_journal_entry.office_id = ''${officeId}'' or ''${officeId}'' = 1 ) group by glcode, acc_gl_account.name order by glcode ) debits left outer join ( select acc_gl_account.gl_code as glcode, name, sum(amount) as creditamount from acc_gl_journal_entry, acc_gl_account where acc_gl_account.id = acc_gl_journal_entry.account_id and acc_gl_journal_entry.type_enum = 1 and acc_gl_account.classification_enum in (1) and acc_gl_journal_entry.entry_date <= ''${endDate}'' and ( acc_gl_journal_entry.office_id = ''${officeId}'' or ''${officeId}'' = 1 ) group by glcode, acc_gl_account.name order by glcode ) credits on debits.glcode = credits.glcode union select credits.glcode as glcode, credits.name as "name", ''Assets'' as BalanceType, ( coalesce(debits.debitamount, 0) - coalesce(credits.creditamount, 0) ) as balance from ( select acc_gl_account.gl_code as glcode, name, sum(amount) as debitamount from acc_gl_journal_entry, acc_gl_account where acc_gl_account.id = acc_gl_journal_entry.account_id and acc_gl_journal_entry.type_enum = 2 and acc_gl_account.classification_enum in (1) and acc_gl_journal_entry.entry_date <= ''${endDate}'' and ( acc_gl_journal_entry.office_id = ''${officeId}'' or ''${officeId}'' = 1 ) group by glcode, acc_gl_account.name order by glcode ) debits right outer join ( select acc_gl_account.gl_code as glcode, name, sum(amount) as creditamount from acc_gl_journal_entry, acc_gl_account where acc_gl_account.id = acc_gl_journal_entry.account_id and acc_gl_journal_entry.type_enum = 1 and acc_gl_account.classification_enum in (1) and acc_gl_journal_entry.entry_date <= ''${endDate}'' and ( acc_gl_journal_entry.office_id = ''${officeId}'' or ''${officeId}'' = 1 ) group by glcode, acc_gl_account.name order by glcode ) credits on debits.glcode = credits.glcode union select debits.glcode as glcode, debits.name as "name", ''Liability'' as BalanceType, ( coalesce(credits.creditamount, 0) - coalesce(debits.debitamount, 0) ) as balance from ( select acc_gl_account.gl_code as glcode, name, sum(amount) as debitamount from acc_gl_journal_entry, acc_gl_account where acc_gl_account.id = acc_gl_journal_entry.account_id and acc_gl_journal_entry.type_enum = 2 and acc_gl_account.classification_enum in (2) and acc_gl_journal_entry.entry_date <= ''${endDate}'' and ( acc_gl_journal_entry.office_id = ''${officeId}'' or ''${officeId}'' = 1 ) group by glcode, acc_gl_account.name order by glcode ) debits left outer join ( select acc_gl_account.gl_code as glcode, name, sum(amount) as creditamount from acc_gl_journal_entry, acc_gl_account where acc_gl_account.id = acc_gl_journal_entry.account_id and acc_gl_journal_entry.type_enum = 1 and acc_gl_account.classification_enum in (2) and acc_gl_journal_entry.entry_date <= ''${endDate}'' and ( acc_gl_journal_entry.office_id = ''${officeId}'' or ''${officeId}'' = 1 ) group by glcode, acc_gl_account.name order by glcode ) credits on debits.glcode = credits.glcode union select credits.glcode as glcode, credits.name as "name", ''Liability'' as BalanceType, ( coalesce(credits.creditamount, 0) - coalesce(debits.debitamount, 0) ) as "balance" from ( select acc_gl_account.gl_code as "glcode", name, sum(amount) as "debitamount" from acc_gl_journal_entry, acc_gl_account where acc_gl_account.id = acc_gl_journal_entry.account_id and acc_gl_journal_entry.type_enum = 2 and acc_gl_account.classification_enum in (2) and acc_gl_journal_entry.entry_date <= ''${endDate}'' and ( acc_gl_journal_entry.office_id = ''${officeId}'' or ''${officeId}'' = 1 ) group by glcode, acc_gl_account.name order by glcode ) debits right outer join ( select acc_gl_account.gl_code as "glcode", name, sum(amount) as "creditamount" from acc_gl_journal_entry, acc_gl_account where acc_gl_account.id = acc_gl_journal_entry.account_id and acc_gl_journal_entry.type_enum = 1 and acc_gl_account.classification_enum in (2) and acc_gl_journal_entry.entry_date <= ''${endDate}'' and ( acc_gl_journal_entry.office_id = ''${officeId}'' or ''${officeId}'' = 1 ) group by glcode, acc_gl_account.name order by glcode ) credits on debits.glcode = credits.glcode union select debits.glcode as "glcode", debits.name as "name", ''Equity'' as BalanceType, ( coalesce(credits.creditamount, 0) - coalesce(debits.debitamount, 0) ) as "balance" from ( select acc_gl_account.gl_code as glcode, name, sum(amount) as debitamount from acc_gl_journal_entry, acc_gl_account where acc_gl_account.id = acc_gl_journal_entry.account_id and acc_gl_journal_entry.type_enum = 2 and acc_gl_account.classification_enum in (3) and acc_gl_journal_entry.entry_date <= ''${endDate}'' and ( acc_gl_journal_entry.office_id = ''${officeId}'' or ''${officeId}'' = 1 ) group by glcode, acc_gl_account.name order by glcode ) debits left outer join ( select acc_gl_account.gl_code as glcode, name, sum(amount) as creditamount from acc_gl_journal_entry, acc_gl_account where acc_gl_account.id = acc_gl_journal_entry.account_id and acc_gl_journal_entry.type_enum = 1 and acc_gl_account.classification_enum in (3) and acc_gl_journal_entry.entry_date <= ''${endDate}'' and ( acc_gl_journal_entry.office_id = ''${officeId}'' or ''${officeId}'' = 1 ) group by glcode, acc_gl_account.name order by glcode ) credits on debits.glcode = credits.glcode union select credits.glcode as glcode, credits.name as "name", ''Equity'' as BalanceType, ( coalesce(credits.creditamount, 0) - coalesce(debits.debitamount, 0) ) as balance from ( select acc_gl_account.gl_code as glcode, name, sum(amount) as debitamount from acc_gl_journal_entry, acc_gl_account where acc_gl_account.id = acc_gl_journal_entry.account_id and acc_gl_journal_entry.type_enum = 2 and acc_gl_account.classification_enum in (3) and acc_gl_journal_entry.entry_date <= ''${endDate}'' and ( acc_gl_journal_entry.office_id = ''${officeId}'' or ''${officeId}'' = 1 ) group by glcode, acc_gl_account.name order by glcode ) debits right outer join ( select acc_gl_account.gl_code as glcode, name, sum(amount) as creditamount from acc_gl_journal_entry, acc_gl_account where acc_gl_account.id = acc_gl_journal_entry.account_id and acc_gl_journal_entry.type_enum = 1 and acc_gl_account.classification_enum in (3) and acc_gl_journal_entry.entry_date <= ''${endDate}'' and ( acc_gl_journal_entry.office_id = ''${officeId}'' or ''${officeId}'' = 1 ) group by glcode, acc_gl_account.name order by glcode ) credits on debits.glcode = credits.glcode )', 'Balance Sheet', true, true, false);
INSERT INTO public.stretchy_report VALUES (174, 'Loan payments received (Active Loans)', 'SMS', 'NonTriggered', 'Loan', 'SELECT mc.id AS id, mc.firstname AS firstName, mc.middlename AS middleName, mc.lastname AS lastName, mc.display_name AS fullName, mc.mobile_no AS mobileNo, ml.principal_amount AS loanAmount, (COALESCE(ml.principal_outstanding_derived, 0) + COALESCE(ml.interest_outstanding_derived, 0) + COALESCE(ml.fee_charges_outstanding_derived, 0) + COALESCE(ml.penalty_charges_outstanding_derived, 0)) AS loanOutstanding, ounder.id AS officeNumber, ml.account_no AS loanAccountNumber, SUM(lt.amount) AS repaymentAmount FROM m_office mo JOIN m_office ounder ON ounder.hierarchy LIKE CONCAT(mo.hierarchy, ''%'') INNER JOIN m_client mc ON mc.office_id = ounder.id INNER JOIN m_loan ml ON ml.client_id = mc.id INNER JOIN r_enum_value rev ON rev.enum_id = ml.loan_status_id AND rev.enum_name = ''loan_status_id'' INNER JOIN m_loan_transaction lt ON lt.loan_id = ml.id INNER JOIN m_appuser au ON au.id = lt.created_by LEFT JOIN m_loan_arrears_aging laa ON laa.loan_id = ml.id LEFT JOIN m_payment_detail mpd ON mpd.id = lt.payment_detail_id LEFT JOIN m_currency cur ON cur.code = ml.currency_code LEFT JOIN m_group_client gc ON gc.client_id = mc.id LEFT JOIN m_group g ON g.id = gc.group_id LEFT JOIN m_staff lo ON lo.id = ml.loan_officer_id LEFT JOIN m_guarantor gua ON gua.loan_id = ml.id WHERE ml.loan_status_id = 300 AND mo.id = ''${officeId}'' AND (COALESCE(ml.loan_officer_id, -10) = ${loanOfficerId} OR ''-1'' = ${loanOfficerId}) AND (EXTRACT(DAY FROM (CURRENT_DATE - lt.transaction_date::TIMESTAMP)) BETWEEN 9${fromX} AND ${toY}) AND lt.is_reversed = false AND lt.transaction_type_enum = 2 AND laa.loan_id IS NULL GROUP BY ml.id, mc.id, ounder.id ORDER BY ounder.hierarchy, ml.currency_code, mc.account_no, ml.account_no', 'Payments received in the last fromX to toY days for any loan with the status Active (on-time)', false, true, false);
INSERT INTO public.stretchy_report VALUES (175, 'Loan payments received (Overdue Loans)', 'SMS', 'NonTriggered', 'Loan', 'SELECT ml.id AS loanId, mc.id AS id, mc.firstname AS firstName, mc.middlename AS middleName, mc.lastname AS lastName, mc.display_name AS fullName, mc.mobile_no AS mobileNo, ml.principal_amount AS loanAmount, (COALESCE(ml.principal_outstanding_derived, 0) + COALESCE(ml.interest_outstanding_derived, 0) + COALESCE(ml.fee_charges_outstanding_derived, 0) + COALESCE(ml.penalty_charges_outstanding_derived, 0)) AS loanOutstanding, ounder.id AS officeNumber, ml.account_no AS loanAccountNumber, SUM(lt.amount) AS repaymentAmount FROM m_office mo JOIN m_office ounder ON ounder.hierarchy LIKE CONCAT(mo.hierarchy, ''%'') INNER JOIN m_client mc ON mc.office_id = ounder.id INNER JOIN m_loan ml ON ml.client_id = mc.id INNER JOIN r_enum_value rev ON rev.enum_id = ml.loan_status_id AND rev.enum_name = ''loan_status_id'' INNER JOIN m_loan_arrears_aging laa ON laa.loan_id = ml.id INNER JOIN m_loan_transaction lt ON lt.loan_id = ml.id INNER JOIN m_appuser au ON au.id = lt.created_by LEFT JOIN m_payment_detail mpd ON mpd.id = lt.payment_detail_id LEFT JOIN m_currency cur ON cur.code = ml.currency_code LEFT JOIN m_group_client gc ON gc.client_id = mc.id LEFT JOIN m_group g ON g.id = gc.group_id LEFT JOIN m_staff lo ON lo.id = ml.loan_officer_id LEFT JOIN m_guarantor gua ON gua.loan_id = ml.id WHERE ml.loan_status_id = 300 AND mo.id = ''${officeId}'' AND (COALESCE(ml.loan_officer_id, -10) = ${loanOfficerId} OR ''-1'' = ${loanOfficerId}) AND (EXTRACT(DAY FROM(CURRENT_DATE - lt.transaction_date::TIMESTAMP)) BETWEEN ${fromX} AND ${toY}) AND (EXTRACT(DAY FROM(CURRENT_DATE - laa.overdue_since_date_derived::TIMESTAMP)) BETWEEN ${overdueX} AND ${overdueY}) AND lt.is_reversed = false AND lt.transaction_type_enum = 2 GROUP BY ml.id, mc.id, ounder.id ORDER BY ounder.hierarchy, ml.currency_code, mc.account_no, ml.account_no', 'Payments received in the last fromX to toY days for any loan with the status Overdue (arrears) between overdueX and overdueY days', false, true, false);
INSERT INTO public.stretchy_report VALUES (149, 'ClientTrendsByDay', 'Table', '', 'Client', 'SELECT COUNT(cl.id) AS count, cl.activation_date AS days             FROM m_office o LEFT JOIN m_client cl on o.id = cl.office_id             WHERE o.hierarchy like concat((select ino.hierarchy from m_office ino where ino.id = ${officeId}),''%'' )                 AND (cl.activation_date BETWEEN (current_date - INTERVAL ''12 DAY'') AND DATE(NOW()- INTERVAL ''1 DAY''))             GROUP BY days             ', 'Retrieves the number of clients joined in last 12 days', true, false, false);
INSERT INTO public.stretchy_report VALUES (150, 'ClientTrendsByWeek', 'Table', '', 'Client', 'SELECT COUNT(cl.id) AS count, WEEK(cl.activation_date) AS Weeks             FROM m_office o LEFT JOIN m_client cl on o.id = cl.office_id             WHERE o.hierarchy like concat((select ino.hierarchy from m_office ino where ino.id = ${officeId}),''%'' )                 AND (cl.activation_date BETWEEN (current_date - INTERVAL ''12 WEEK'') AND DATE(NOW()))             GROUP BY Weeks             ', '', true, false, false);
INSERT INTO public.stretchy_report VALUES (151, 'ClientTrendsByMonth', 'Table', '', 'Client', 'SELECT COUNT(cl.id) AS count, MONTHNAME(cl.activation_date) AS Months             FROM m_office o LEFT JOIN m_client cl on o.id = cl.office_id             WHERE o.hierarchy like concat((select ino.hierarchy from m_office ino where ino.id = ${officeId}),''%'' )                 AND (cl.activation_date BETWEEN (current_date - INTERVAL ''12 MONTH'') AND DATE(NOW()))             GROUP BY Months             ', '', true, false, false);
INSERT INTO public.stretchy_report VALUES (156, 'Disbursal Vs Awaitingdisbursal', 'Table', '', 'Loan', 'SELECT awaitinddisbursal.amount-disbursedAmount.amount as amountToBeDisburse, disbursedAmount.amount as disbursedAmount from             (SELECT COUNT(ln.id) AS noOfLoans, COALESCE(SUM(ln.principal_amount),0) AS amount FROM m_office o             LEFT JOIN m_client cl ON cl.office_id = o.id             LEFT JOIN m_loan ln ON cl.id = ln.client_id             WHERE (ln.loan_status_id=200 OR ln.loan_status_id=300) AND                 o.hierarchy like concat((select ino.hierarchy from m_office ino where ino.id = ${officeId}),''%'' )             ) awaitinddisbursal,             (SELECT COUNT(ltrxn.id) as count, COALESCE(SUM(ltrxn.amount),0) as amount FROM m_office o             LEFT JOIN m_client cl ON cl.office_id = o.id             LEFT JOIN m_loan ln ON cl.id = ln.client_id             LEFT JOIN m_loan_transaction ltrxn ON ln.id = ltrxn.loan_id             WHERE ltrxn.is_reversed = false AND ltrxn.transaction_type_enum=1 AND                 o.hierarchy like concat((select ino.hierarchy from m_office ino where ino.id = ${officeId}),''%'' )             ) disbursedAmount             ', 'Disbursal_Vs_Awaitingdisbursal', true, false, false);
INSERT INTO public.stretchy_report VALUES (197, 'Trial Balance Summary Report', 'Table', NULL, 'Accounting', 'SELECT *             FROM             (               SELECT                 ''${endDate}'' AS PostingDate,                 loan.pname AS Product,                 loan.gl_code AS GlAcct,                 loan.glname AS Description,                 loan.openingbalance AS BeginningBalance,                 (loan.debitamount * 1) AS DebitMovement,                 (loan.creditamount *-1) AS CreditMovement,                 (                   loan.openingbalance + loan.debitamount - loan.creditamount                 ) AS EndingBalance               FROM                 (                   SELECT                     g.pname,                     g.gl_code,                     g.glname,                     COALESCE(debits.debitamount, 0) - COALESCE(debits.creditamount, 0) AS openingbalance,                     COALESCE(loanproduct.debitamount, 0) AS debitamount,                     COALESCE(loanproduct.creditamount, 0) AS creditamount                   FROM                     (                       SELECT                         ag.gl_code,                         pl.name AS pname,                         ag.name AS glname                       FROM                         acc_gl_account ag                         JOIN acc_product_mapping am ON am.gl_account_id = ag.id                         AND am.product_type = 1                         JOIN m_product_loan pl ON pl.id = am.product_id                     ) g                     LEFT JOIN (                       SELECT                         lp.name AS productname,                         acc_gl_account.gl_code AS glcode,                         acc_gl_account.name AS glname,                         sum(                           case when acc_gl_journal_entry.type_enum = 2 then amount ELSE 0 end                         ) AS debitamount,                         sum(                           case when acc_gl_journal_entry.type_enum = 1 then amount ELSE 0 end                         ) AS creditamount                       FROM                         acc_gl_account                         JOIN acc_gl_journal_entry on acc_gl_account.id = acc_gl_journal_entry.account_id                         JOIN m_loan m ON m.id = acc_gl_journal_entry.entity_id                         JOIN m_product_loan lp ON lp.id = m.product_id                       WHERE                         acc_gl_journal_entry.entity_type_enum = 1                         AND acc_gl_journal_entry.manual_entry = false                         and acc_gl_journal_entry.submitted_on_date < ''${endDate}''                         and (                           acc_gl_journal_entry.office_id = ${officeId}                         )                       group by                         productname,                         glcode,                         glname                       order by                         glcode                     ) debits ON g.gl_code = debits.glcode                     AND debits.productname = g.pname                     LEFT JOIN (                       SELECT                         lp.name AS productname, account_id,                         acc_gl_account.gl_code AS glcode,                         acc_gl_account.name AS glname,                         sum(                           case when acc_gl_journal_entry.type_enum = 2 then amount ELSE 0 END                         ) AS debitamount,                         sum(                           case when acc_gl_journal_entry.type_enum = 1 then amount ELSE 0 END                         ) AS creditamount                       FROM                         acc_gl_journal_entry                         JOIN acc_gl_account on acc_gl_account.id = acc_gl_journal_entry.account_id                         JOIN m_loan m ON m.id = acc_gl_journal_entry.entity_id                         JOIN m_product_loan lp ON lp.id = m.product_id                       WHERE                         acc_gl_journal_entry.entity_type_enum = 1                         AND acc_gl_journal_entry.manual_entry = false                         and acc_gl_journal_entry.submitted_on_date = ''${endDate}''                         AND (                           acc_gl_journal_entry.office_id = ${officeId}                         )                       group by                         productname,                         account_id,                         glcode,                         glname                       order by                         glcode                     ) loanproduct ON g.gl_code = loanproduct.glcode                     AND loanproduct.productname = g.pname                 ) loan               UNION               SELECT                 ''${endDate}'' AS PostingDate,                 loan.pname AS Product,                 loan.gl_code AS GlAcct,                 loan.glname AS Description,                 loan.openingbalance AS Beginning_Balance,                 loan.debitamount AS Debit_Movement,                 loan.creditamount AS Credit_Movement,                 (                   loan.openingbalance + loan.debitamount - loan.creditamount                 ) AS Ending_Balance               FROM                 (                   SELECT                     g.pname,                     g.gl_code,                     g.glname,                     COALESCE(debits.debitamount, 0) - COALESCE(debits.creditamount, 0) AS openingbalance,                     COALESCE(loanproduct.debitamount, 0) AS debitamount,                     COALESCE(loanproduct.creditamount, 0) AS creditamount                   FROM                     (                       SELECT                         ag.gl_code,                         pl.name AS pname,                         ag.name AS glname                       FROM                         acc_gl_account ag                         JOIN acc_product_mapping am ON am.gl_account_id = ag.id                         AND am.product_type = 2                         JOIN m_savings_product pl ON pl.id = am.product_id                     ) g                     LEFT join (                       SELECT                         lp.name productname,                         acc_gl_account.gl_code AS glcode,                         acc_gl_account.name AS glname,                         sum(                           case when acc_gl_journal_entry.type_enum = 2 then amount ELSE 0 end                         ) AS debitamount,                         sum(                           case when acc_gl_journal_entry.type_enum = 1 then amount ELSE 0 end                         ) AS creditamount                       FROM                         acc_gl_account                         join acc_gl_journal_entry on acc_gl_account.id = acc_gl_journal_entry.account_id                         JOIN m_savings_account m ON m.id = acc_gl_journal_entry.entity_id                         JOIN m_savings_product lp ON lp.id = m.product_id                       WHERE                         acc_gl_journal_entry.entity_type_enum = 2                         AND acc_gl_journal_entry.manual_entry = false                         and acc_gl_journal_entry.submitted_on_date < ''${endDate}''                         and (                           acc_gl_journal_entry.office_id = ${officeId}                         )                       group by                         productname,                         glcode,                         glname                       order by                         glcode                     ) debits ON g.gl_code = debits.glcode                     AND debits.productname = g.pname                     left JOIN (                       SELECT                         lp.name productname,                         acc_gl_account.gl_code AS glcode,                         acc_gl_account.name AS glname,                         sum(                           case when acc_gl_journal_entry.type_enum = 2 then amount ELSE 0 end                         ) AS debitamount,                         sum(                           case when acc_gl_journal_entry.type_enum = 1 then amount ELSE 0 end                         ) AS creditamount                       from                         acc_gl_journal_entry                         join acc_gl_account on acc_gl_account.id = acc_gl_journal_entry.account_id                         JOIN m_savings_account m ON m.id = acc_gl_journal_entry.entity_id                         JOIN m_savings_product lp ON lp.id = m.product_id                       WHERE                         acc_gl_journal_entry.entity_type_enum = 2                         AND acc_gl_journal_entry.manual_entry = false                         and acc_gl_journal_entry.submitted_on_date = ''${endDate}''                         and (                           acc_gl_journal_entry.office_id = ${officeId}                         )                       group by                         productname,                         glcode,                         glname                       order by                         glcode                     ) loanproduct ON g.gl_code = loanproduct.glcode                     AND loanproduct.productname = g.pname                 ) loan               UNION               SELECT                 ''${endDate}'' AS PostingDate,                 ''manual'' AS Product,                 loan.gl_code AS GlAcct,                 loan.glname AS Description,                 loan.openingbalance AS Beginning_Balance,                 loan.debitamount AS Debit_Movement,                 loan.creditamount AS Credit_Movement,                 (                   loan.openingbalance + loan.debitamount - loan.creditamount                 ) AS Ending_Balance               FROM                 (                   SELECT                     g.gl_code,                     g.name AS glname,                     COALESCE(debits.debitamount, 0) - COALESCE(debits.creditamount, 0) AS openingbalance,                     COALESCE(loanproduct.debitamount, 0) AS debitamount,                     COALESCE(loanproduct.creditamount, 0) AS creditamount                   FROM                     acc_gl_account g                     LEFT join (                       SELECT                         acc_gl_account.gl_code AS glcode,                         acc_gl_account.name AS glname,                         sum(                           case when acc_gl_journal_entry.type_enum = 2 then amount ELSE 0 end                         ) AS debitamount,                         sum(                           case when acc_gl_journal_entry.type_enum = 1 then amount ELSE 0 end                         ) AS creditamount                       FROM                         acc_gl_account                         JOIN acc_gl_journal_entry on acc_gl_account.id = acc_gl_journal_entry.account_id                       WHERE                         acc_gl_journal_entry.manual_entry = true                         and acc_gl_journal_entry.submitted_on_date < ''${endDate}''                         and (                           acc_gl_journal_entry.office_id = ${officeId}                         )                       group by                         glcode,                         glname                       order by                         glcode                     ) debits ON g.gl_code = debits.glcode                     left JOIN (                       SELECT                         acc_gl_account.gl_code AS glcode,                         acc_gl_account.name AS glname,                         sum(                           case when acc_gl_journal_entry.type_enum = 2 then amount ELSE 0 end                         ) AS debitamount,                         sum(                           case when acc_gl_journal_entry.type_enum = 1 then amount ELSE 0 end                         ) AS creditamount                       FROM                         acc_gl_journal_entry                         join acc_gl_account on acc_gl_account.id = acc_gl_journal_entry.account_id                       where                         acc_gl_journal_entry.manual_entry = true                         and acc_gl_journal_entry.submitted_on_date = ''${endDate}''                         and (                           acc_gl_journal_entry.office_id = ${officeId}                         )                       group by                         glcode,                         glname                       order by                         glcode                     ) loanproduct ON g.gl_code = loanproduct.glcode                 ) loan             ) a           where             a.EndingBalance != 0 or a.DebitMovement != 0 or a.CreditMovement != 0 ', 'Trial Balance Summary Report', false, true, false);
INSERT INTO public.stretchy_report VALUES (198, 'Transaction Summary Report', 'Table', NULL, 'Accounting', 'SELECT             ''${endDate}'' AS TransactionDate,             a.product AS Product,             (               SELECT                 enum_message_property               FROM                 r_enum_value               WHERE                 enum_name = ''transaction_type_enum''                 and enum_id = a.transaction_type             ) TransactionType_Name,             (               select                 value               from                 m_payment_type               where                 id = a.payment_type_id             ) as PaymentType_Name,             a.chargetype as chargetype,             a.reversal_indicator AS Reversed,             a.Allocation_Type AS Allocation_Type,             '''' AS Chargeoff_ReasonCode,             case when a.transaction_type IN (2, 23, 21, 22, 24, 4, 5, 8, 6, 27, 9, 26)             AND a.reversal_indicator = false then sum(a.amount) * -1 when a.transaction_type IN (2, 23, 21, 22, 24, 4, 5, 8, 6, 27, 9, 26)             AND a.reversal_indicator = true then sum(a.amount) * + 1 when a.transaction_type IN (1, 10, 25, 20)             AND a.reversal_indicator = false then sum(a.amount) * + 1 when a.transaction_type IN (1, 10, 25, 20)             AND a.reversal_indicator = true then sum(a.amount) * -1 end AS Transaction_Amount           FROM             (               SELECT                 ''${endDate}'' AS transactiondate,                 t.id,                 l.name AS product,                 t.transaction_type_enum AS transaction_type,                 d.payment_type_id,                 '''' as chargetype,                 false AS reversal_indicator,                 ''Principal'' AS Allocation_Type,                 CASE when t.transaction_type_enum in (1) then (                   case when t.amount is null then 0 else t.amount end                 ) else (                   case when t.principal_portion_derived is null then 0 else t.principal_portion_derived end                 ) end amount               FROM                 m_loan_transaction t                 JOIN m_loan m ON m.id = t.loan_id                 JOIN m_product_loan l ON l.id = m.product_id                 left join m_payment_detail d on d.id = t.payment_detail_id               WHERE                 t.submitted_on_date = ''${endDate}''                 and t.transaction_type_enum not in (10, 26)                 and (t.office_id = ${officeId})               UNION ALL               SELECT                 ''${endDate}'' AS transactiondate,                 t.id,                 l.name AS product,                 t.transaction_type_enum AS transaction_type,                 d.payment_type_id,                 '''' as chargetype,                 false AS reversal_indicator,                 ''Interest'' AS Allocation_Type,                 case when t.interest_portion_derived is null then 0 else t.interest_portion_derived end AS amount               FROM                 m_loan_transaction t                 JOIN m_loan m ON m.id = t.loan_id                 JOIN m_product_loan l ON l.id = m.product_id                 left join m_payment_detail d on d.id = t.payment_detail_id               WHERE                 t.submitted_on_date = ''${endDate}''                 and t.transaction_type_enum not in (10, 26)                 and (t.office_id = ${officeId})               UNION ALL               SELECT                 ''${endDate}'' AS transactiondate,                 t.id,                 l.name AS product,                 t.transaction_type_enum AS transaction_type,                 d.payment_type_id,                 '''' as chargetype,                 false AS reversal_indicator,                 ''Fees'' AS Allocation_Type,                 case when t.fee_charges_portion_derived is null then 0 else t.fee_charges_portion_derived end as amount               FROM                 m_loan_transaction t                 JOIN m_loan m ON m.id = t.loan_id                 JOIN m_product_loan l ON l.id = m.product_id                 left join m_payment_detail d on d.id = t.payment_detail_id               WHERE                 t.submitted_on_date = ''${endDate}''                 and t.transaction_type_enum not in (10, 26)                 and (t.office_id = ${officeId})               UNION ALL               SELECT                 ''${endDate}'' AS transactiondate,                 t.id,                 l.name AS product,                 t.transaction_type_enum AS transaction_type,                 d.payment_type_id,                 '''' as chargetype,                 false AS reversal_indicator,                 ''Penalty'' AS Allocation_Type,                 case when t.penalty_charges_portion_derived is null then 0 else t.penalty_charges_portion_derived end as amount               FROM                 m_loan_transaction t                 JOIN m_loan m ON m.id = t.loan_id                 JOIN m_product_loan l ON l.id = m.product_id                 left join m_payment_detail d on d.id = t.payment_detail_id               WHERE                 t.submitted_on_date = ''${endDate}''                 and t.transaction_type_enum not in (10, 26)                 and (t.office_id = ${officeId})               UNION ALL               SELECT                 ''${endDate}'' AS transactiondate,                 t.id,                 l.name AS product,                 t.transaction_type_enum AS transaction_type,                 d.payment_type_id,                 '''' as chargetype,                 false AS reversal_indicator,                 ''Unallocated Credit (UNC)'' AS Allocation_Type,                 case when t.overpayment_portion_derived is null then 0 else t.overpayment_portion_derived end as amount               FROM                 m_loan_transaction t                 JOIN m_loan m ON m.id = t.loan_id                 JOIN m_product_loan l ON l.id = m.product_id                 left join m_payment_detail d on d.id = t.payment_detail_id               WHERE                 t.submitted_on_date = ''${endDate}''                 and t.transaction_type_enum not in (10, 26)                 and (t.office_id = ${officeId})               UNION ALL               SELECT                 ''${endDate}'' AS transactiondate,                 t.id,                 l.name AS product,                 t.transaction_type_enum AS transaction_type,                 null,                 mc.name,                 false AS reversal_indicator,                 ''Fees'' AS Allocation_Type,                 case when pd.amount is null then 0 else pd.amount end as amount               FROM                 m_loan_transaction t                 JOIN m_loan m ON m.id = t.loan_id                 JOIN m_product_loan l ON l.id = m.product_id                 join m_loan_charge_paid_by pd on pd.loan_transaction_id = t.id                 join m_loan_charge c on c.id = pd.loan_charge_id                 join m_charge mc on mc.id = c.charge_id                 and mc.is_penalty = false               WHERE                 t.submitted_on_date = ''${endDate}''                 and t.transaction_type_enum = 10                 and t.is_reversed = false                 and (t.office_id = ${officeId})               UNION ALL               SELECT                 ''${endDate}'' AS transactiondate,                 t.id,                 l.name AS product,                 t.transaction_type_enum AS transaction_type,                 null,                 mc.name,                 false AS reversal_indicator,                 ''Penalty'' AS Allocation_Type,                 case when pd.amount is null then 0 else pd.amount end as amount               FROM                 m_loan_transaction t                 JOIN m_loan m ON m.id = t.loan_id                 JOIN m_product_loan l ON l.id = m.product_id                 join m_loan_charge_paid_by pd on pd.loan_transaction_id = t.id                 join m_loan_charge c on c.id = pd.loan_charge_id                 join m_charge mc on mc.id = c.charge_id                 and mc.is_penalty = true               WHERE                 t.submitted_on_date = ''${endDate}''                 and t.transaction_type_enum = 10                 and t.is_reversed = false                 and (t.office_id = ${officeId})               UNION ALL               SELECT                 ''${endDate}'' AS transactiondate,                 t.id,                 l.name AS product,                 t.transaction_type_enum AS transaction_type,                 null,                 '''' as chargetype,                 false AS reversal_indicator,                 ''Interest'' AS Allocation_Type,                 case when t.interest_portion_derived is null then 0 else t.interest_portion_derived end AS amount               FROM                 m_loan_transaction t                 JOIN m_loan m ON m.id = t.loan_id                 JOIN m_product_loan l ON l.id = m.product_id               WHERE                 t.submitted_on_date = ''${endDate}''                 and t.transaction_type_enum = 10                 and t.is_reversed = false                 and (t.office_id = ${officeId})               UNION ALL               SELECT                 ''${endDate}'' AS transactiondate,                 t.id,                 l.name AS product,                 t.transaction_type_enum AS transaction_type,                 d.payment_type_id,                 mc.name,                 false AS reversal_indicator,                 ''Fees'' AS Allocation_Type,                 case when pd.amount is null then 0 else pd.amount end as amount               FROM                 m_loan_transaction t                 JOIN m_loan m ON m.id = t.loan_id                 JOIN m_product_loan l ON l.id = m.product_id                 join m_loan_charge_paid_by pd on pd.loan_transaction_id = t.id                 join m_loan_charge c on c.id = pd.loan_charge_id                 join m_charge mc on mc.id = c.charge_id                 and mc.is_penalty = false                 left join m_payment_detail d on d.id = t.payment_detail_id               WHERE                 t.submitted_on_date = ''${endDate}''                 and t.transaction_type_enum = 26                 and (t.office_id = ${officeId})               UNION ALL               SELECT                 ''${endDate}'' AS transactiondate,                 t.id,                 l.name AS product,                 t.transaction_type_enum AS transaction_type,                 d.payment_type_id,                 mc.name,                 false AS reversal_indicator,                 ''Penalty'' AS Allocation_Type,                 case when pd.amount is null then 0 else pd.amount end AS amount               FROM                 m_loan_transaction t                 JOIN m_loan m ON m.id = t.loan_id                 JOIN m_product_loan l ON l.id = m.product_id                 join m_loan_charge_paid_by pd on pd.loan_transaction_id = t.id                 join m_loan_charge c on c.id = pd.loan_charge_id                 join m_charge mc on mc.id = c.charge_id                 and mc.is_penalty = true                 left join m_payment_detail d on d.id = t.payment_detail_id               WHERE                 t.submitted_on_date = ''${endDate}''                 and t.transaction_type_enum = 26                 and (t.office_id = ${officeId})               UNION ALL               SELECT                 ''${endDate}'' AS transactiondate,                 t.id,                 l.name AS product,                 t.transaction_type_enum AS transaction_type,                 d.payment_type_id,                 '''' as chargetype,                 false AS reversal_indicator,                 ''Interest'' AS Allocation_Type,                 case when t.interest_portion_derived is null then 0 else t.interest_portion_derived end AS amount               FROM                 m_loan_transaction t                 JOIN m_loan m ON m.id = t.loan_id                 JOIN m_product_loan l ON l.id = m.product_id                 left join m_payment_detail d on d.id = t.payment_detail_id               WHERE                 t.submitted_on_date = ''${endDate}''                 and t.transaction_type_enum = 26                 and (t.office_id = ${officeId})               UNION ALL               SELECT                 ''${endDate}'' AS transactiondate,                 t.id,                 l.name AS product,                 t.transaction_type_enum AS transaction_type,                 d.payment_type_id,                 '''' as chargetype,                 false AS reversal_indicator,                 ''Principal'' AS Allocation_Type,                 case when t.principal_portion_derived is null then 0 else t.principal_portion_derived end AS amount               FROM                 m_loan_transaction t                 JOIN m_loan m ON m.id = t.loan_id                 JOIN m_product_loan l ON l.id = m.product_id                 left join m_payment_detail d on d.id = t.payment_detail_id               WHERE                 t.submitted_on_date = ''${endDate}''                 and t.transaction_type_enum = 26                 and (t.office_id = ${officeId})               UNION ALL               SELECT                 ''${endDate}'' AS transactiondate,                 t.id,                 l.name AS product,                 t.transaction_type_enum AS transaction_type,                 d.payment_type_id,                 '''' as chargetype,                 false AS reversal_indicator,                 ''Unallocated Credit (UNC)'' AS Allocation_Type,                 case when t.overpayment_portion_derived is null then 0 else t.overpayment_portion_derived end AS amount               FROM                 m_loan_transaction t                 JOIN m_loan m ON m.id = t.loan_id                 JOIN m_product_loan l ON l.id = m.product_id                 left join m_payment_detail d on d.id = t.payment_detail_id               WHERE                 t.submitted_on_date = ''${endDate}''                 and t.transaction_type_enum = 26                 and (t.office_id = ${officeId})               UNION ALL               SELECT                 ''${endDate}'' AS transactiondate,                 t.id,                 l.name AS product,                 t.transaction_type_enum AS transaction_type,                 d.payment_type_id,                 '''' as chargetype,                 true AS reversal_indicator,                 ''Principal'' AS Allocation_Type,                 CASE when t.transaction_type_enum in (1) then (                   case when t.amount is null then 0 else t.amount end                 ) else (                   case when t.principal_portion_derived is null then 0 else t.principal_portion_derived end                 ) end amount               FROM                 m_loan_transaction t                 JOIN m_loan m ON m.id = t.loan_id                 JOIN m_product_loan l ON l.id = m.product_id                 left join m_payment_detail d on d.id = t.payment_detail_id               WHERE                 t.reversed_on_date = ''${endDate}''                 and t.transaction_type_enum not in (10, 26)                 and (t.office_id = ${officeId})               UNION ALL               SELECT                 ''${endDate}'' AS transactiondate,                 t.id,                 l.name AS product,                 t.transaction_type_enum AS transaction_type,                 d.payment_type_id,                 '''' as chargetype,                 true AS reversal_indicator,                 ''Interest'' AS Allocation_Type,                 case when t.interest_portion_derived is null then 0 else t.interest_portion_derived end AS amount               FROM                 m_loan_transaction t                 JOIN m_loan m ON m.id = t.loan_id                 JOIN m_product_loan l ON l.id = m.product_id                 left join m_payment_detail d on d.id = t.payment_detail_id               WHERE                 t.reversed_on_date = ''${endDate}''                 and t.transaction_type_enum not in (10, 26)                 and (t.office_id = ${officeId})               UNION ALL               SELECT                 ''${endDate}'' AS transactiondate,                 t.id,                 l.name AS product,                 t.transaction_type_enum AS transaction_type,                 d.payment_type_id,                 '''' as chargetype,                 true AS reversal_indicator,                 ''Fees'' AS Allocation_Type,                 case when t.fee_charges_portion_derived is null then 0 else t.fee_charges_portion_derived end as amount               FROM                 m_loan_transaction t                 JOIN m_loan m ON m.id = t.loan_id                 JOIN m_product_loan l ON l.id = m.product_id                 left join m_payment_detail d on d.id = t.payment_detail_id               WHERE                 t.reversed_on_date = ''${endDate}''                 and t.transaction_type_enum not in (10, 26)                 and (t.office_id = ${officeId})               UNION ALL               SELECT                 ''${endDate}'' AS transactiondate,                 t.id,                 l.name AS product,                 t.transaction_type_enum AS transaction_type,                 d.payment_type_id,                 '''' as chargetype,                 true AS reversal_indicator,                 ''Penalty'' AS Allocation_Type,                 case when t.penalty_charges_portion_derived is null then 0 else t.penalty_charges_portion_derived end as amount               FROM                 m_loan_transaction t                 JOIN m_loan m ON m.id = t.loan_id                 JOIN m_product_loan l ON l.id = m.product_id                 left join m_payment_detail d on d.id = t.payment_detail_id               WHERE                 t.reversed_on_date = ''${endDate}''                 and t.transaction_type_enum not in (10, 26)                 and (t.office_id = ${officeId})               UNION ALL               